INSERT INTO `hunuo_article` VALUES ('4', '2', '用户协议', '<p>欢迎您使用服务（下称：本服务），您在使用本服务前请认真阅读以下协议（下称：本协议）。</p><p><br/></p><p>一、使用协议的接受</p><p>当您在注册程序过程中在“已阅读，同意本《使用协议》”处打勾“√”并按照注册程序成功注册为用户，或您以其他允许的方式实际使用服务时，即表示您已充分阅读、理解并接受本协议的全部内容，并与达成协议</p><p><br/></p><p>二、本协议的变更和修改</p><p>有权随时对本协议进行修改，并且一旦发生协议条款的变动，将在相关页面上提示修改的内容；用户如果不同意本协议的修改，可以放弃使用或访问本网站或取消已经获得的服务；如果用户选择在本协议变更后继续访问或使用本网站，则视为用户已经接受本协议的修改。</p><p>2、运用自己的系统通过互联网向用户提供服务，除非另有明确定，增强或强化目前服务的任何新功能，包括新产品以及新增加的服务，均无条件地适用本协议。</p><p><br/></p><p>二、本协议的变更和修改</p><p>有权随时对本协议进行修改，并且一旦发生协议条款的变动，将在相关页面上提示修改的内容；用户如果不同意本协议的修改，可以放弃使用或访问本网站或取消已经获得的服务；如果用户选择在本协议变更后继续访问或使用本网站，则视为用户已经接受本协议的修改。</p><p>2、运用自己的系统通过互联网向用户提供服务，除非另有明确定，增强或强化目前服务的任何新功能，包括新产品以及新增加的服务，均无条件地适用本协议。</p><p><br/></p><p>二、本协议的变更和修改</p><p>有权随时对本协议进行修改，并且一旦发生协议条款的变动，将在相关页面上提示修改的内容；用户如果不同意本协议的修改，可以放弃使用或访问本网站或取消已经获得的服务；如果用户选择在本协议变更后继续访问或使用本网站，则视为用户已经接受本协议的修改。</p><p>2、运用自己的系统通过互联网向用户提供服务，除非另有明确定，增强或强化目前服务的任何新功能，包括新产品以及新增加的服务，均无条件地适用本协议。</p>', '', '', '', '1', '1', '0', '1291604914', 'data/article/1524551078740139512.jpg', '2', 'http://', '', '100', '0');
