INSERT INTO `hunuo_article` VALUES ('125', '23', '韩元兑人民币汇率走势图 今日最新查询', '<br/><p style=\"text-align: center; text-indent: 2em; line-height: 2em;\"><img src=\"http://phpmall.gz6.hostadm.net/includes/ueditor/php/../../../images/image/59971462241406.jpg\" title=\"Cg-4WFGHHTmIUXDCAAB0GooW7fwAAIRVgEuk98AAHQy446.jpg\"/></p><p style=\"text-indent: 2em; line-height: 2em;\">第一黄金网讯 据银行间外汇市场最新数据显示，2016年04月29日韩元兑人民币汇率中间价为：1韩元兑人民币0.0057元，100韩元兑人民币0.57元。1人民币对175.2838韩元，100人民币对17528.38韩元。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">据韩国媒体报道，韩国政府为打造“创意经济”，去年推出370亿韩元的预算(约合3236万美元)，最终一共有1021亿韩元(约合8929万美元)流入了新兴企业。业内人士认为，措施使新兴企业受益，但仍需在制度上多加完善。</p><p style=\"text-indent: 2em; line-height: 2em;\">培育新兴企业和风险企业是韩国政府“创意经济”的核心课题。为培育情报通信技术(I.T)与融合领域有潜力的新兴企业，政府推出了各种各样的创业支持项目。过去三年间，仅未来创意科学部与韩国信息通信产业振兴院(NIPA)、网络振兴院(KISA)、数据基础振兴院(KODB)、产下机构Born2Global中心等下属机构推出的创业支援项目就有27个之多。去年，未来创意科学部对此进行整合并推出“K-Global项目”，提高了政策支持的效率。</p><p><br/></p>', '', '', '', '0', '1', '0', '1437347517', '', '0', 'http://', '', '100', '2');
INSERT INTO `hunuo_article` VALUES ('126', '23', '聚焦：广东7市已公开年票信息', '<p>&nbsp; &nbsp; 今年的省两会上，年票成为了热议话题。2月23日，广东省交通厅党组书记、厅长曾兆庚带队上线省“民声热线”再次明确表示，年内将出台逐步取消年票方案。此外，省交通厅也下了最后通牒：本月底各地必须公开年票信息。截至26日，佛山、中山、清远、云浮、潮州、茂名、揭阳7市已公布2014年度年票制信息。</p><p><br/></p><p>　　曾兆庚在该节目上表示，广东收取年票是合法的，但确实存在不合理的地方。“各地市对取消年票也是认同的态度，同时也在积极地制定取消年票的方案。”曾兆庚进一步明确表示，年票实施的主体是各地政府，年票取消方案也将由各地政府制定各自的方案，按照规定上报省交通厅审批后实施。年内将出台取消年票的方案，在方案出台前，会充分征求公众的意见。</p><p><br/></p><p>　　另外，截至2014年末，广东年票债务余额共500多亿元，年票取消后，政府还贷压力剧增，会不会大规模恢复收费站，采取次票的方式收取费用？曾兆庚回应称，取消年票制以后，二级公路及二级以下等级公路不允许再设立收费站，一律不准再收取年票、次票，极个别公路在收费期间，符合国家收费规定的经申请批准后，可继续申请收费。年票取消后，不会出现大规模恢复收费站的情况。</p><p><br/></p><p>　　曾兆庚还指出将来道路收费的大方向，他表示，除保留高速公路收费，对于其他道路，鼓励各市尽可能不收就不收，将来地方道路不收费是规划的目标。</p><p><br/></p><p>　　关于年票的争议，年票收取后的使用不能成为一笔“糊涂账”也越来越成为共识。1月份，省交通厅发文要求17个收取年票的市交通运输局（委）在2月10日前，通过政府网站公开经审计的年票信息，包括收费年限、收支情况和剩余债务等7项内容。然而截至26日，仅有佛山、中山、清远、云浮、潮州、茂名、揭阳7市公布了2014年度年票制信息。</p><p><br/></p><p>　　对此，曾兆庚回应，本月底各地市须按要求统一公开年票的相关信息。他还提到，目前各地市都在积极配合公开的工作，但也不排除个别地市没有理清全部的问题，可能晚点才公开的情况。</p><p><br/></p><p>　　编辑点评：对于年票信息公开，其实大家更关心的是年票到底何时废除。省交通厅的表态似乎在派“定心丸”，但仔细一看又觉得好像没说什么。毕竟年票的事情经过发酵，取消已成为共识，但“逐步取消”，怎么个逐步法，究竟到什么时候才取消，没人能给出答案。从如今的形势来分析，这是迟早的事。</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://phpmall.gz6.hostadm.net/includes/ueditor/php/../../../bdimages/upload1/20160429/1461920969106447.jpg\" title=\"20140506170006854.jpg\"/></p>', '', '', '', '0', '1', '0', '1437347633', '', '0', 'http://', '', '100', '2');
INSERT INTO `hunuo_article` VALUES ('127', '22', '广东电商产品抽检 网民“点菜”政府“买单', '<p style=\"line-height: 2em;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://phpmall.gz6.hostadm.net/includes/ueditor/php/../../../bdimages/upload1/20160429/1461921007725429.jpg\" title=\"Cg-4WFGHHTmIUXDCAAB0GooW7fwAAIRVgEuk98AAHQy446.jpg\"/></p><p style=\"line-height: 2em;\"><br/></p><p style=\"line-height: 2em;\">&nbsp;&nbsp;广东省启动“2016我参与电商产品质量提升”体验活动</p><p><br/></p><p style=\"line-height: 2em;\">　　为有效提升电商产品质量监督抽查工作的有效性，进一步扩大全社会对质监工作的知情权、参与权和监督权，广东省质监局决定启动“2016我参与电商产品质量提升”体验活动。抽检什么产品、抽检哪个电商平台、抽检哪个批次，完全由广大网民决定，真正做到由网民“点菜”，质监部门按单“做菜”，政府来“买单”，让监督抽查更加贴近百姓日常生活。</p><p><br/></p><p style=\"line-height: 2em;\">　　“2016我参与电商产品质量提升”活动将从4月开始持续到11月，共包括5个环节：选定抽查产品（4—5月）——邀请志愿监督员（5—6月）——“神秘买家购样”（7月）——完成产品检验（8—10月）——召开新闻发布会发布产品监督抽查结果（11月上旬）。由消费者根据自我感知，对某种电商产品提出检验要求，由省质监局组织网民集中从电子商务平台购买样品，委托第三方权威检测机构独立开展检验检测。 （记者/胡新科 通讯员/岳志轩）</p><p><br/></p>', '', '', '', '0', '1', '0', '1437347666', '', '0', 'http://', '', '100', '1');
INSERT INTO `hunuo_article` VALUES ('128', '22', '北京销售岗位最受欢迎 “90后”白领平均月薪5570元', '<p style=\"LINE-HEIGHT: 2em\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p style=\"LINE-HEIGHT: 2em\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img title=\"t016ed6cad4f7f5ecd7.jpg\" src=\"http://phpmall.gz6.hostadm.net/includes/ueditor/php/../../../images/image/4601463468867.jpg\"/></p><p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">&nbsp;&nbsp;&nbsp; 近日，由人瑞集团推出的国内首个<span style=\"FONT-FAMILY: Calibri\">O2O</span><span style=\"FONT-FAMILY: 宋体\">招聘平台香草招聘联合北京人力资源服务行业协会、上海人才服务行业协会共同发布《“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”基层白领就业报告》。报告显示，北京地区“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领的平均月薪为</span><span style=\"FONT-FAMILY: Calibri\">5570</span><span style=\"FONT-FAMILY: 宋体\">元，略低于上海的</span><span style=\"FONT-FAMILY: Calibri\">5980</span><span style=\"FONT-FAMILY: 宋体\">元，位居全国第二。同时，不同于“</span><span style=\"FONT-FAMILY: Calibri\">70</span><span style=\"FONT-FAMILY: 宋体\">后”、“</span><span style=\"FONT-FAMILY: Calibri\">80</span><span style=\"FONT-FAMILY: 宋体\">后”，“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领在择业过程中呈现出“求新、求快、求挑战”的特点，工作压力较大同时薪水也较高的销售岗位最受欢迎。另外，超过三成的北京“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领工作一年一换，换工作频率低于其他城市。</span></span></p><p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">　　香草招聘数据显示，北京地区“<span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领的平均月收入为</span><span style=\"FONT-FAMILY: Calibri\">5570</span><span style=\"FONT-FAMILY: 宋体\">元，较之</span><span style=\"FONT-FAMILY: Calibri\">2014</span><span style=\"FONT-FAMILY: 宋体\">年北京市职工</span><span style=\"FONT-FAMILY: Calibri\">6463</span><span style=\"FONT-FAMILY: 宋体\">元的月平均工资（</span><span style=\"FONT-FAMILY: Calibri\">2015</span><span style=\"FONT-FAMILY: 宋体\">年的相关数据尚未公布）低了</span><span style=\"FONT-FAMILY: Calibri\">893</span><span style=\"FONT-FAMILY: 宋体\">元。而</span><span style=\"FONT-FAMILY: Calibri\">4000</span><span style=\"FONT-FAMILY: 宋体\">元至</span><span style=\"FONT-FAMILY: Calibri\">6000</span><span style=\"FONT-FAMILY: 宋体\">元成为“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领的工资常态，占到</span><span style=\"FONT-FAMILY: Calibri\">60%</span><span style=\"FONT-FAMILY: 宋体\">，有</span><span style=\"FONT-FAMILY: Calibri\">4%</span><span style=\"FONT-FAMILY: 宋体\">的工资只有两三千元。</span></span></p><p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">　　同时，北京地区人事岗位以<span style=\"FONT-FAMILY: Calibri\">6100</span><span style=\"FONT-FAMILY: 宋体\">元平均月薪力压销售岗位的</span><span style=\"FONT-FAMILY: Calibri\">5940</span><span style=\"FONT-FAMILY: 宋体\">元，位居岗位薪资排行第一。网络</span><span style=\"FONT-FAMILY: Calibri\">/IT</span><span style=\"FONT-FAMILY: 宋体\">岗（</span><span style=\"FONT-FAMILY: Calibri\">5915</span><span style=\"FONT-FAMILY: 宋体\">元）、大堂经理（</span><span style=\"FONT-FAMILY: Calibri\">5900</span><span style=\"FONT-FAMILY: 宋体\">元）等岗位紧随其后。而最受“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领欢迎的岗位被销售岗夺得，人事岗紧居其后，其次是行政以及网络</span><span style=\"FONT-FAMILY: Calibri\">/IT</span><span style=\"FONT-FAMILY: 宋体\">等岗位。</span></span></p><p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">　　报告显示，个人职业发展前景力压“钱景”，成为“<span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领求职最看重的因素。其中，</span><span style=\"FONT-FAMILY: Calibri\">49%</span><span style=\"FONT-FAMILY: 宋体\">的人群将“个人职业发展前景”作为求职的首选因素，首选“薪水”的仅占到两成。</span></span></p><p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">　　与“<span style=\"FONT-FAMILY: Calibri\">70</span><span style=\"FONT-FAMILY: 宋体\">后”、“</span><span style=\"FONT-FAMILY: Calibri\">80</span><span style=\"FONT-FAMILY: 宋体\">后”求稳相比，“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领在工作过程中更加“求新、求快、求挑战”，并且换工作频率较高。数据显示，北京地区超三成（</span><span style=\"FONT-FAMILY: Calibri\">34%</span><span style=\"FONT-FAMILY: 宋体\">）“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”一年换一次工作，两年换一次工作以及三年换一次工作的分别占</span><span style=\"FONT-FAMILY: Calibri\">26%</span><span style=\"FONT-FAMILY: 宋体\">与</span><span style=\"FONT-FAMILY: Calibri\">21%</span><span style=\"FONT-FAMILY: 宋体\">。此外，移动招聘平台成为“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”找工作的主要渠道。</span></span></p><p></p>', '', '', '', '0', '1', '0', '1437347803', '', '0', 'http://', '', '100', '0');
INSERT INTO `hunuo_article` VALUES ('129', '22', '进口电商：亚健康模式下的“包税”还能硬撑多久？', '<p>&nbsp; &nbsp; &nbsp;“包税”、“进口税全额返还”、“奶粉为你包税，母婴好货不怕税”、“包美保税专场”一条一条鲜明的标语仿佛是商家在面对徐来之客抛出的口号。距离4月8日进口税改正式落地已经半个多月，“正面清单”、“补充清单”相继落地。雨果网对比4月11日和4月25日两日各大跨境电商平台发现，不少商家已经开始逐步缩小税改活动，甚至取消了之前的“包税”促销。“包税”、“返税”后续乏力。</p><p><br/></p><p>&nbsp; &nbsp; &nbsp;专营进口母婴的蜜芽在4月11日主页上挂出“奶粉为你包税，母婴好货不怕税”、“食品全球购为你省税”、“包美保税专场”最高满199减100的促销活动。这三个针对税改专场，在化妆品、婴幼儿食品、服装、玩具、进口零食、饮料等几类商品进行促销。</p><p>　　但是在4月25日蜜芽主页上并没有看到类似的促销活动。以蜜芽自营的荷兰诺优能婴幼儿奶粉1段850g为例，4月11日的售价133元，包含税费和运费，由保税仓发货，最少两罐起订，可以使用商家提供的优惠券。但在4月25日，该款产品同样只能以两罐形式售卖，但是价格却有所降低，标价为248两瓶。当点击进入结算页面时才发现，原来这个价格并不包含进口税，进口税费显示为29.52元，符合11.92%的税率。结算总价为277.52元，平均单罐价格为138.76元，比4月11日上涨了约5元并不能使用优惠券。</p><p>　　同样以自营的荷兰诺优能婴幼儿奶粉1段850g为例，网易考拉海购价格为108元，丰趣海淘178元，与4月11号显示价格无异，但是均显示无货状态。仔细观察，网易考拉售价虽然不变，但是在商品描述中的发货地已经悄然从广东保税1号仓变为香港。联系客服表示，如果从香港仓发货产生税费，将由顾客先行垫付，网易考拉将返还顾客代缴的税费。</p><p>　　与单瓶不同，三瓶装网易考拉海购自营的荷兰诺优能婴幼儿奶粉1段850g网页上显示售价为354元，状态为有货，杭州保税3号仓发货，在结算页面显示还需收取38.56元税费，但是能用满299减30的优惠券，结算后总价为362.56元，平均每瓶奶粉价格为120.85元，高出4月11日单瓶108元12.85元。而这高出的12.85元恰恰和11.9%的税率相当。</p><p>　　曾在11日首页上贴出“比海外更便宜，原装进口税额全返”的天猫国际在25日也没有延续之前的“包税”活动，在25日点击进入该平台网站，发现这个活动已经撤销，甚至在首页都看不见有类似的活动。苏宁海外购推出的“海外新风尚，税改不加价”活动到19日截止，目前也没有延续下去。</p><p>　　纵观各大电商平台网站，商家推出的包税、免税、返税的产品多是局限在奶粉、纸尿裤、玩具、进口零食等小件商品，且基本税率都在11.9%的品类内，而高税率的商品基本都没有参与活动，不少热销产品仅仅售出一百多件就宣布无货。</p><p>　　“包税”背后的真相</p><p>　　有分析指，此次的税改给跨境电商带来了不小的冲击，不少商品本身获利空间就不大，许多“爆款”本身就是贴钱在换用户。而且目前包税清货商品多为4月8日税改之前就已经在仓或是在运输途中的商品，这些商品数量有限，包税活动肯定不会持久，这种“包税”也只是在目前政策不明朗的情况下一种过渡手段罢了，毕竟都是商家在倒贴钱。</p><p>　　“这与网络约车的补贴大战一样，都是商家为了先保住份额的举动，但肯定不会是长期的行为，最多在新税制实施的前一两周会搞搞这类活动，但不会常态化。”有电商人士表示，包税策略会持续多久可能也是此轮跨境电商的一项竞争内容。</p><p>　　万国优品总经理张宗涛向雨果网表示，表面上这是一次促销活动，本质上是一场战争，“平台商家包税是一次大型电商借助新政机会整合行业、淘汰中小电商的行动，在战争过后，价格将回归原位。”</p><p>　　“目前保税仓的库存商品还可以正常清关，但这也是最后一批库存，在赚得眼球的同时，还能尽快把这部分库存变现了，以后政策的变化具有很大的不确定性。”一帆海购网总经理薛寿能表示，“另一方面，包税以后的价格实际上大多是上涨了的，或者真正落到实处的优惠减少了”。</p><p>　　与此相验证的是，许多跨境电商人士透露，在4月8日后保税仓的货物基本只出不进，备货仅仅可供20天左右。不少商家连夜把保税仓货物运往香港、日本等地。</p><p>　　税改正面清单要求进口电商企业参照一般贸易进口的商品标准，很多企业做不到，所以商品即使是在正面清单内，商品将来也无法在保税仓发货，因为无法满足“一线”进区要求。</p><p>　　鉴于无法采用保税仓发货形式，不少商家转向海外仓发货或国外直邮，但是随之而来的运输成本和过长耗时也让跨境电商望而却步。</p><p>　　亚健康模式下的“包税”</p><p>　　有消费者表示，税改之前许多平台就有打折活动，屯了好多货。在税改出台后海淘感觉并没有什么变化，税都商家包了，有的东西甚至还比之前便宜。</p><p>　　之前有报道指出，在去年平台竞争最激烈的时候，一包代购成本为150元的纸尿裤可以以亏损68元的价格卖出，只为了换取用户，但是这一行径也让跨境电商受伤不浅，光是纸尿裤这一项就能让电商平台一年损失一千多万。而如今，不仅价格不能涨，连税都要商家“包”了。</p><p>　　“所谓的包税、免税、返税，不过都是商家的促销手段罢了，把直接的降价说成免税更能吸引买家，但确确实实是商家自己进行的补贴，因为没有谁能在进口环节少缴税。”</p><p>　　张宗涛认为，在新政条件下，如果商品仍是由保税区发货，在同等价格情况下，商家很难通过“包税”将11.9%的税收成本完全控制消化掉。</p><p>　　从长期来看，这种商家“包税”模式并不健康。这只是商家利用资金换取流量的传统模式，与一般促销模式差异不大。薛寿能认为，违背长期政策的营销活动只是暂时的过渡而已，包税促销肯定是不可持续，等以后消费者慢慢适应了税收政策，就会回到正常的销售。</p><p style=\"text-align: center;\"><img src=\"http://phpmall.gz6.hostadm.net/includes/ueditor/php/../../../bdimages/upload1/20160429/1461920541163348.jpg\" title=\"201312160906164931.jpg\"/><br/></p>', '', '', '', '0', '1', '0', '1437347838', '', '0', 'http://', '', '100', '12');
INSERT INTO `hunuo_article` VALUES ('130', '22', '电商横扩趋势加速家电行业升', '<p style=\"line-height: 2em;\"><img src=\"http://phpmall.gz6.hostadm.net/includes/ueditor/php/../../../bdimages/upload1/20160429/1461914133963137.jpg\" title=\"t01c3c716d9405dde3c.jpg\"/>近日，国家发改委等多个部委制定并发布了《关于促进消费带动转型升级的行动方案》，文中明确表示，为带动产业结构的进一步升级，将发掘农村电商消费的市场潜力，鼓励重点建设县级电商运营服务中心和改造乡村信息化综合经营服务网点。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">去年O2O商业模式成井喷式爆发态势，以外卖、专车等新兴行业进击势头尤为迅猛，究其根本，这些现象的出现都源于网络时代的进一步加速与推进，轻量化，便捷化的商业模式更符合当下年轻消费者群体的消费习惯，而这一部分人已逐渐转变成社会消费主体的中坚力量。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">近期互联网舆论也颇不平静，以家电零售行业热议“告同行书”为契机，舆论对当下家电零售存在的销售弊端观点明确，传统连锁卖场的运营模式已难以切入现阶段的主流消费市场。从线下传统渠道的垄断时代，再到近几年以京东为代表的线上渠道的崛起，在这样的行业趋势下，苏宁、国美等传统渠道也开始火速向互联网转型。昔日的线下垄断局面在今日看来已经成为助力线上渠道火爆的铺垫，这也从侧面加速了消费者对线上卖场的认可度和依赖性。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">由此可见，电商的加速横扩趋势愈发明显，覆盖范围愈来愈广，就各行业来看，继服饰、餐饮、3C等领域之后，家电行业已成为国民互联网化的下一个蓝海市场，线上渠道借助于产业模式的便捷性，更受时下消费者的青睐。记者曹婧逸</p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p>', '', '', '', '0', '1', '0', '1437347908', '', '0', 'http://', '', '100', '1');
