INSERT INTO `hunuo_article` VALUES ('31', '12', '三衢电商翻番战役攻坚推进会召开', '<p style=\"text-indent: 2em; line-height: 2em;\">本报讯（记者吴江怀通讯员蓝丹玉）昨天下午，三衢电商翻番战役攻坚推进会暨第二野战军授旗仪式在龙游举行。副市长、三衢电商总指挥马梅芝出席会议并讲话。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">马梅芝指出，要认真贯彻落实市委、市政府部署要求，对照一季度我市电商发展存在的短板，按照“夯实基度、汇聚浓度”的核心战略发展三衢电商，不断培育和壮大电商产业本底，汇聚各类创新要素，形成强大的创新生态体系。要牢牢把握“抓聚焦”的工作导向，聚焦打造电商总部经济，聚焦日用消费品、传统企业、“三农”嫁接电商，聚焦招商引才，聚焦组织体系优势转化为产业优势，打好三衢电商翻番攻坚战。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">马梅芝强调，各电商战队要用足用好理念创新、管理创新、头脑风暴、对标“一流”、奖惩倒逼等创新武器，通过举办专业论坛、邀请专家授课、建立战队微信群、奖优罚劣等措施，积极营造浓厚的电商发展氛围，推动三衢电商走高端发展之路，争取以“连续翻番、突破奇点、占据高点”的战果领跑全省、影响全国。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">会上，新创立的第二野战军——龙游电商战队和5支新成立的市级战队一同接受授旗并誓师。</p><p><br/></p>', '', '', '', '0', '1', '0', '1242579069', '', '0', 'http://', '', '100', '0');
INSERT INTO `hunuo_article` VALUES ('32', '12', '你玩“双11”我推“爽11” 电商短兵相接倒计时', '<p style=\"text-indent: 2em; line-height: 2em;\">新民网·独家报道“双十一”电商大战一触即发。距离11月11日还有不到一天，新民网记者今日（10日）看到，电商之间的正面交锋已经进入白热化，为了避开阿里抢注的“双十一”，类似“爽11”这样的宣传“战术”频频抢镜，当“双11”撞上“爽11”，今年这个光棍节格外热闹。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">这个夜里0点，阿里的双11大促即将启动，不管是1小时内卖出多少个亿，还是出货吸干多少个西湖的纸尿裤，连续举办五六年后，这些已经成为双11的标签与符号。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">新民网记者了解到，也因此，作为每年电商们的“兵家必争”之战，“双十一”大战已经日益激烈。而今年阿里方面突然宣布注册了“双十一”商标，让不少早已制定好包含“双十一”宣传语的其他电商有些措手不及。然而，在距离“双十一”仅一天不到时，苏宁等电商纷纷祭出“杀器”，打出“爽11”这样的宣传语，和阿里方面“正面交锋”。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">“苏宁虽然不像京东一样受到阿里商标事件的重大波及，但毕竟销售节点同在光棍节，也与阿里一直在较劲。”业内人士告诉记者，也正因如此，在阿里要做双11的当下，苏宁方面顺水推舟打出了“爽11”，意在和其针锋相对。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">&nbsp;</p><p style=\"text-indent: 2em; line-height: 2em;\">业内人士指出，今年“双十一”从打法上来看，阿里主要仍是通过红包、折扣、及广告投入为主。而苏宁的玩法则相对多样，除了红包、低价外，还有声波二维码、货品极速达、15天无条件退货等新花样，“从今天刚公布的数据来看，苏宁方面线上订单量已经达到1000万。”而接下来即将于阿里正面交锋，苏宁等新晋电商能否借机再发力，抢占市场份额，也成为业内关注的重点。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">分析人士指出，如今的电商大战已经不再是行业的内的事情，“不论是当年的价格之战，还是今天的商标之争，都已经成为消费者茶余饭后的谈资。”消费者日益理智和冷静，更多的学会了理性看待、计划消费，坐看各家电商短兵相接，适时出手享实惠。所以，电商大战中，谁能给消费者更多实惠才是最重要的。”（新民网记者 李欣）</p><p><br/></p>', '', '', '', '1', '1', '0', '1242579189', '', '0', 'http://', '', '100', '0');
INSERT INTO `hunuo_article` VALUES ('33', '22', '北京销售岗位最受欢迎 “90后”白领平均月薪5570元', '<p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">&nbsp;&nbsp;&nbsp; 近日，由人瑞集团推出的国内首个<span style=\"FONT-FAMILY: Calibri\">O2O</span><span style=\"FONT-FAMILY: 宋体\">招聘平台香草招聘联合北京人力资源服务行业协会、上海人才服务行业协会共同发布《“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”基层白领就业报告》。报告显示，北京地区“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领的平均月薪为</span><span style=\"FONT-FAMILY: Calibri\">5570</span><span style=\"FONT-FAMILY: 宋体\">元，略低于上海的</span><span style=\"FONT-FAMILY: Calibri\">5980</span><span style=\"FONT-FAMILY: 宋体\">元，位居全国第二。同时，不同于“</span><span style=\"FONT-FAMILY: Calibri\">70</span><span style=\"FONT-FAMILY: 宋体\">后”、“</span><span style=\"FONT-FAMILY: Calibri\">80</span><span style=\"FONT-FAMILY: 宋体\">后”，“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领在择业过程中呈现出“求新、求快、求挑战”的特点，工作压力较大同时薪水也较高的销售岗位最受欢迎。另外，超过三成的北京“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领工作一年一换，换工作频率低于其他城市。</span></span></p><p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">　　香草招聘数据显示，北京地区“<span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领的平均月收入为</span><span style=\"FONT-FAMILY: Calibri\">5570</span><span style=\"FONT-FAMILY: 宋体\">元，较之</span><span style=\"FONT-FAMILY: Calibri\">2014</span><span style=\"FONT-FAMILY: 宋体\">年北京市职工</span><span style=\"FONT-FAMILY: Calibri\">6463</span><span style=\"FONT-FAMILY: 宋体\">元的月平均工资（</span><span style=\"FONT-FAMILY: Calibri\">2015</span><span style=\"FONT-FAMILY: 宋体\">年的相关数据尚未公布）低了</span><span style=\"FONT-FAMILY: Calibri\">893</span><span style=\"FONT-FAMILY: 宋体\">元。而</span><span style=\"FONT-FAMILY: Calibri\">4000</span><span style=\"FONT-FAMILY: 宋体\">元至</span><span style=\"FONT-FAMILY: Calibri\">6000</span><span style=\"FONT-FAMILY: 宋体\">元成为“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领的工资常态，占到</span><span style=\"FONT-FAMILY: Calibri\">60%</span><span style=\"FONT-FAMILY: 宋体\">，有</span><span style=\"FONT-FAMILY: Calibri\">4%</span><span style=\"FONT-FAMILY: 宋体\">的工资只有两三千元。</span></span></p><p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">　　同时，北京地区人事岗位以<span style=\"FONT-FAMILY: Calibri\">6100</span><span style=\"FONT-FAMILY: 宋体\">元平均月薪力压销售岗位的</span><span style=\"FONT-FAMILY: Calibri\">5940</span><span style=\"FONT-FAMILY: 宋体\">元，位居岗位薪资排行第一。网络</span><span style=\"FONT-FAMILY: Calibri\">/IT</span><span style=\"FONT-FAMILY: 宋体\">岗（</span><span style=\"FONT-FAMILY: Calibri\">5915</span><span style=\"FONT-FAMILY: 宋体\">元）、大堂经理（</span><span style=\"FONT-FAMILY: Calibri\">5900</span><span style=\"FONT-FAMILY: 宋体\">元）等岗位紧随其后。而最受“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领欢迎的岗位被销售岗夺得，人事岗紧居其后，其次是行政以及网络</span><span style=\"FONT-FAMILY: Calibri\">/IT</span><span style=\"FONT-FAMILY: 宋体\">等岗位。</span></span></p><p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">　　报告显示，个人职业发展前景力压“钱景”，成为“<span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领求职最看重的因素。其中，</span><span style=\"FONT-FAMILY: Calibri\">49%</span><span style=\"FONT-FAMILY: 宋体\">的人群将“个人职业发展前景”作为求职的首选因素，首选“薪水”的仅占到两成。</span></span></p><p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">　　与“<span style=\"FONT-FAMILY: Calibri\">70</span><span style=\"FONT-FAMILY: 宋体\">后”、“</span><span style=\"FONT-FAMILY: Calibri\">80</span><span style=\"FONT-FAMILY: 宋体\">后”求稳相比，“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”白领在工作过程中更加“求新、求快、求挑战”，并且换工作频率较高。数据显示，北京地区超三成（</span><span style=\"FONT-FAMILY: Calibri\">34%</span><span style=\"FONT-FAMILY: 宋体\">）“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”一年换一次工作，两年换一次工作以及三年换一次工作的分别占</span><span style=\"FONT-FAMILY: Calibri\">26%</span><span style=\"FONT-FAMILY: 宋体\">与</span><span style=\"FONT-FAMILY: Calibri\">21%</span><span style=\"FONT-FAMILY: 宋体\">。此外，移动招聘平台成为“</span><span style=\"FONT-FAMILY: Calibri\">90</span><span style=\"FONT-FAMILY: 宋体\">后”找工作的主要渠道。</span></span></p><p><br/></p>', '', '', '', '1', '1', '0', '1242579559', 'data/article/1507616679231660274.jpg', '2', 'http://', '', '100', '0');
INSERT INTO `hunuo_article` VALUES ('34', '12', '阿里加入国际反假货联盟 24家品牌不乐意', '<p style=\"text-indent: 2em; line-height: 2em;\">4月28日，国外媒体报道，阿里巴巴本月早些时候加入了“国际反假联盟”(以下简称“IACC”)。公司当时表示，这凸显了阿里巴巴打假的决心。</p><p style=\"text-indent: 2em; line-height: 2em;\">IACC是全球最大的反假联盟之一，拥有约250名成员。虽然如此，《华尔街日报》网站报道称，一些品牌厂商还是对阿里巴巴在平台上的打假决心持怀疑态度。</p><p style=\"text-indent: 2em; line-height: 2em;\">上周，美国时尚品牌迈克·科尔斯(Michael Korsy)就以IACC接纳阿里巴巴为由退出该联盟。此外，法国奢侈品牌珑骧 (Longchamp)和另一家反假联盟Unifab也对IACC的决定提出批评。</p><p style=\"text-indent: 2em; line-height: 2em;\">迈克·科尔斯在致IACC信函中称，在许多品牌厂商考虑通过诉讼迫使阿里巴巴加大打假力度之际，接纳她为会员将“掩盖我们最危险和最具破坏性的对手”。</p><p style=\"text-indent: 2em; line-height: 2em;\">迈克·科尔斯总法律顾问李·斯波恩(Lee Sporn)称：“阿里巴巴的一贯策略就是：嘴上说支持打假，但实际行动却跟不上。”</p><p style=\"text-indent: 2em; line-height: 2em;\">而阿里巴巴则表示，公司始终在竭尽所能地打击其平台上的假货。阿里巴巴全球知识产权执法部门负责人马修·巴西尤尔(Matthew Bassiur)在一份声明中称，能成为IACC成员，这是阿里巴巴在与全球品牌合作打击假货的“又一重要步骤”。</p><p style=\"text-indent: 2em; line-height: 2em;\">多家品牌反对据</p><p style=\"text-indent: 2em; line-height: 2em;\">IACC前主席芭芭拉·科尔逊(Barbara Kolsun)称，约24家品牌和IACC成员通过电子邮件和电话私下表达了对迈克·科尔斯立场的支持。由于与阿里巴巴有合作，这些品牌不便公开身份。</p><p style=\"text-indent: 2em; line-height: 2em;\">拥有约400家会员的反假联盟Unifab向《华尔街日报》表示，如果阿里巴巴不能迅速采取强硬措施打击假货，一些品牌厂商将考虑对其采取一系列措施。</p><p style=\"text-indent: 2em; line-height: 2em;\">IACC总裁鲍勃·巴奇斯(Bob Barchiesi)对此表示，由21名成员组成的董事会一致同意接纳阿里巴巴为会员。这将允许各成员能更直接地与阿里巴巴合作，从而更有效地打击假货。</p><p style=\"text-indent: 2em; line-height: 2em;\">本月早些时候，在宣布接纳阿里巴巴为会员时，IACC曾将阿里巴巴称为“打击假货和盗版最强有力的合作伙伴之一”。另外，IACC已经邀请阿里巴巴创始人马云(微博)在5月份的全球品牌年会上发表主题演讲。</p><p style=\"text-indent: 2em; line-height: 2em;\">当然，也有支持阿里巴巴加入IACC的声音。例如，美国唱片产业协会(RIAA)就表示，理解品牌对阿里巴巴加盟的担忧，但该机构反盗版执行副总裁布拉德·巴克尔斯(Brad Buckles)称：“让我不理解的是，为什么接纳阿里巴巴为会员就是一件很糟糕的事情呢？加入IACC后，阿里巴巴将必须考虑我们的感受。”</p><p style=\"text-indent: 2em; line-height: 2em;\">在此次一些品牌厂商不满阿里巴巴加入IACC之前的4个月，美国贸易官员曾警告阿里巴巴，需要加强对淘宝和天猫平台的打假力度。而阿里巴巴表示，公司正在简化下架假货的程序。阿里巴巴还称，2年前曾与IACC在简化假货下架程序方面有过一次合作，关闭了近5000家店铺，其店主被永久封杀。</p><p style=\"text-indent: 2em; line-height: 2em;\">打假措施九牛一毛代表十多家品牌的律师克里斯蒂娜·蒙塔纳罗·施拉德(Kristina Montanaro Schrader)称，迄今为止阿里巴巴在打击假货方面的努力与存在的问题相比简直是九牛一毛。法国开云集团(Kering)旗下奢侈品牌已经起诉了阿里巴巴，称阿里巴巴鼓励销售假货并从中获利。而阿里巴巴则表示，该诉讼毫无依据。而且，阿里巴巴在帮助品牌打假方面有良好记录。Unifab总干事戴尔芬·萨法蒂-索伯雷拉(Delphine Sarfati-Sobreira)称，在过去的数年，阿里巴巴一直在承诺打假，而Unifab会员仍在等待“有说服力的结果”。而阿里巴巴称，他们已经向IACC表明了保护品牌利益的诚意。IACC总裁巴奇斯说，IACC的决定必须代表大多数成员的利益，而阿里巴巴已经证明，在与品牌合作打假方面表现不错。</p><p><br/></p>', '', '', '', '0', '1', '0', '1242580013', '', '0', 'http://', '', '100', '0');
