INSERT INTO `hunuo_article` VALUES ('47', '9', '企业服务3', '<p>OTEE是中国人气设计师互动平台，汇聚超过500万注册设计师，强力覆盖中国核心设计创意从业人群在设计创意群体中具有较高的影响力与号召力。</p>', '', '', '', '0', '1', '0', '1292316101', 'data/article/1524551571691565151.png', '0', '', '', '100', '0');
INSERT INTO `hunuo_article` VALUES ('61', '12', '韩元兑人民币汇率走势图 今日最新查询', '<p style=\"text-indent: 2em; line-height: 2em;\">第一黄金网讯 据银行间外汇市场最新数据显示，2016年04月29日韩元兑人民币汇率中间价为：1韩元兑人民币0.0057元，100韩元兑人民币0.57元。1人民币对175.2838韩元，100人民币对17528.38韩元。</p><p style=\"text-indent: 2em;\"><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">据韩国媒体报道，韩国政府为打造“创意经济”，去年推出370亿韩元的预算(约合3236万美元)，最终一共有1021亿韩元(约合8929万美元)流入了新兴企业。业内人士认为，措施使新兴企业受益，但仍需在制度上多加完善。</p><p style=\"text-indent: 2em; line-height: 2em;\">培育新兴企业和风险企业是韩国政府“创意经济”的核心课题。为培育情报通信技术(I.T)与融合领域有潜力的新兴企业，政府推出了各种各样的创业支持项目。过去三年间，仅未来创意科学部与韩国信息通信产业振兴院(NIPA)、网络振兴院(KISA)、数据基础振兴院(KODB)、产下机构Born2Global中心等下属机构推出的创业支援项目就有27个之多。去年，未来创意科学部对此进行整合并推出“K-Global项目”，提高了政策支持的效率。</p><p><br/></p>', '', '', '', '0', '1', '0', '1313660801', '', '0', 'http://', '', '100', '0');
INSERT INTO `hunuo_article` VALUES ('62', '12', '聚焦：广东7市已公开年票信息', '<p style=\"line-height: 2em;\">&nbsp; &nbsp; 今年的省两会上，年票成为了热议话题。2月23日，广东省交通厅党组书记、厅长曾兆庚带队上线省“民声热线”再次明确表示，年内将出台逐步取消年票方案。此外，省交通厅也下了最后通牒：本月底各地必须公开年票信息。截至26日，佛山、中山、清远、云浮、潮州、茂名、揭阳7市已公布2014年度年票制信息。</p><p><br/></p><p style=\"line-height: 2em;\">　　曾兆庚在该节目上表示，广东收取年票是合法的，但确实存在不合理的地方。“各地市对取消年票也是认同的态度，同时也在积极地制定取消年票的方案。”曾兆庚进一步明确表示，年票实施的主体是各地政府，年票取消方案也将由各地政府制定各自的方案，按照规定上报省交通厅审批后实施。年内将出台取消年票的方案，在方案出台前，会充分征求公众的意见。</p><p><br/></p><p style=\"line-height: 2em;\">　　另外，截至2014年末，广东年票债务余额共500多亿元，年票取消后，政府还贷压力剧增，会不会大规模恢复收费站，采取次票的方式收取费用？曾兆庚回应称，取消年票制以后，二级公路及二级以下等级公路不允许再设立收费站，一律不准再收取年票、次票，极个别公路在收费期间，符合国家收费规定的经申请批准后，可继续申请收费。年票取消后，不会出现大规模恢复收费站的情况。</p><p><br/></p><p style=\"line-height: 2em;\">　　曾兆庚还指出将来道路收费的大方向，他表示，除保留高速公路收费，对于其他道路，鼓励各市尽可能不收就不收，将来地方道路不收费是规划的目标。</p><p><br/></p><p style=\"line-height: 2em;\">　　关于年票的争议，年票收取后的使用不能成为一笔“糊涂账”也越来越成为共识。1月份，省交通厅发文要求17个收取年票的市交通运输局（委）在2月10日前，通过政府网站公开经审计的年票信息，包括收费年限、收支情况和剩余债务等7项内容。然而截至26日，仅有佛山、中山、清远、云浮、潮州、茂名、揭阳7市公布了2014年度年票制信息。</p><p><br/></p><p style=\"line-height: 2em;\">　　对此，曾兆庚回应，本月底各地市须按要求统一公开年票的相关信息。他还提到，目前各地市都在积极配合公开的工作，但也不排除个别地市没有理清全部的问题，可能晚点才公开的情况。</p><p><br/></p><p style=\"line-height: 2em;\">　　编辑点评：对于年票信息公开，其实大家更关心的是年票到底何时废除。省交通厅的表态似乎在派“定心丸”，但仔细一看又觉得好像没说什么。毕竟年票的事情经过发酵，取消已成为共识，但“逐步取消”，怎么个逐步法，究竟到什么时候才取消，没人能给出答案。从如今的形势来分析，这是迟早的事。</p><p><br/></p>', '', '', '', '0', '1', '0', '1313660809', '', '0', 'http://', '', '100', '0');
INSERT INTO `hunuo_article` VALUES ('63', '12', '广东电商产品抽检 网民“点菜”政府“买单', '<p style=\"line-height: 2em;\">&nbsp; &nbsp; 广东省启动“2016我参与电商产品质量提升”体验活动</p><p><br/></p><p style=\"line-height: 2em;\">　　为有效提升电商产品质量监督抽查工作的有效性，进一步扩大全社会对质监工作的知情权、参与权和监督权，广东省质监局决定启动“2016我参与电商产品质量提升”体验活动。抽检什么产品、抽检哪个电商平台、抽检哪个批次，完全由广大网民决定，真正做到由网民“点菜”，质监部门按单“做菜”，政府来“买单”，让监督抽查更加贴近百姓日常生活。</p><p><br/></p><p style=\"line-height: 2em;\">　　“2016我参与电商产品质量提升”活动将从4月开始持续到11月，共包括5个环节：选定抽查产品（4—5月）——邀请志愿监督员（5—6月）——“神秘买家购样”（7月）——完成产品检验（8—10月）——召开新闻发布会发布产品监督抽查结果（11月上旬）。由消费者根据自我感知，对某种电商产品提出检验要求，由省质监局组织网民集中从电子商务平台购买样品，委托第三方权威检测机构独立开展检验检测。 （记者/胡新科 通讯员/岳志轩）</p><p><br/></p>', '', '', '', '0', '1', '0', '1313660816', '', '0', 'http://', '', '100', '0');
