INSERT INTO `hunuo_article` VALUES ('118', '12', '二次回踩确认支撑 午后或有大动作', '<p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">&nbsp;&nbsp;&nbsp;&nbsp;早盘沪深两市微涨，开盘后存在惯性冲高，并站长<span style=\"FONT-FAMILY: Calibri\">2850</span><span style=\"FONT-FAMILY: 宋体\">点重要位置，随后题材板块纷纷回踩，拖累股指震荡下行，不仅</span><span style=\"FONT-FAMILY: Calibri\">2850</span><span style=\"FONT-FAMILY: 宋体\">点得而复失，同时也跌破</span><span style=\"FONT-FAMILY: Calibri\">5</span><span style=\"FONT-FAMILY: 宋体\">日均线的支撑。随后股指在</span><span style=\"FONT-FAMILY: Calibri\">5</span><span style=\"FONT-FAMILY: 宋体\">日均线受到支撑，股指短暂形成止跌。早盘市场股指羸弱，三大股指纷纷走低，并且盘中热点较少，近期表现较好的板块，如稀土、锂电池、猪肉等板块，除了稀土板块维持上涨外，其他板块纷纷回踩，猪肉板块甚至领跌，可见近期涨幅较为明显的板块出现获利回吐的苗头。盘面上，两市成交继续维持在低位徘徊，稀土、油气改革、有色金属等少量板块维持上行；运输服务、猪肉、家用电器、工程机械、无人驾驶等板块领跌。</span></span></p><p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">&nbsp;&nbsp;&nbsp;&nbsp;从市场本身的走势来看，早盘股指站上<span style=\"FONT-FAMILY: Calibri\">2850</span><span style=\"FONT-FAMILY: 宋体\">点后出现回踩，可见股指在</span><span style=\"FONT-FAMILY: Calibri\">2850</span><span style=\"FONT-FAMILY: 宋体\">点上方面临较多的密集成交区的筹码，确实是受到一定的压力，再加上最近市场的成交量持续萎缩，并未有持续的量能释放出来，故股指在密集成交区的附近只能是震荡整理，从而消化密集成交区的压力。另外，股指最近两周的调整以来，抛售的压力已经大幅度的减少，空方的宣泄告一段落，空方短期内也没有多少能量再次杀跌，而最近几个交易日股指连续在</span><span style=\"FONT-FAMILY: Calibri\">2800</span><span style=\"FONT-FAMILY: 宋体\">点上方真理运行，我们认为这是多方聚集能量的地方。</span></span></p><p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">&nbsp;&nbsp;&nbsp;&nbsp;技术分析来看，<span style=\"FONT-FAMILY: Calibri\">MACD</span><span style=\"FONT-FAMILY: 宋体\">逐渐走高，</span><span style=\"FONT-FAMILY: Calibri\">KDJ</span><span style=\"FONT-FAMILY: 宋体\">的也有低位金叉的迹象，股指也于周一站上</span><span style=\"FONT-FAMILY: Calibri\">5</span><span style=\"FONT-FAMILY: 宋体\">日均线上方，从日线的角度来看，其要有一个回踩的过程，而今日下跌至</span><span style=\"FONT-FAMILY: Calibri\">5</span><span style=\"FONT-FAMILY: 宋体\">日均线，我们认为是二次回踩确认的一个过程。</span></span></p><p style=\"LINE-HEIGHT: 2em\"><span style=\"FONT-SIZE: 14px; FONT-FAMILY: 宋体\">&nbsp;&nbsp;&nbsp;&nbsp;综合分析来看，虽然今日股指出现回踩，但是并不会改变股指短期筑底的走势，市场短期的上攻走势几乎确认。不过成交量的不足，始终是影响股指反弹的高度和时间长度的不确定因素之一，所以我们建议投资者一定要控制好仓位，轻仓参与股指的反弹即可，且不可用重仓博弈，包括稀土永磁、<span style=\"FONT-FAMILY: Calibri\">OLED</span><span style=\"FONT-FAMILY: 宋体\">、锂电池等板块存在一定的布局机会。</span></span></p><p></p>', '', '', '', '0', '1', '0', '1437346999', '', '0', 'http://', '', '100', '0');
INSERT INTO `hunuo_article` VALUES ('119', '22', '进口电商：亚健康模式下的“包税”还能硬撑多久？', '<p style=\"line-height: 2em;\">&nbsp; &nbsp; &nbsp;“包税”、“进口税全额返还”、“奶粉为你包税，母婴好货不怕税”、“包美保税专场”一条一条鲜明的标语仿佛是商家在面对徐来之客抛出的口号。距离4月8日进口税改正式落地已经半个多月，“正面清单”、“补充清单”相继落地。雨果网对比4月11日和4月25日两日各大跨境电商平台发现，不少商家已经开始逐步缩小税改活动，甚至取消了之前的“包税”促销。“包税”、“返税”后续乏力。</p><p><br/></p><p style=\"line-height: 2em;\">&nbsp; &nbsp; &nbsp;专营进口母婴的蜜芽在4月11日主页上挂出“奶粉为你包税，母婴好货不怕税”、“食品全球购为你省税”、“包美保税专场”最高满199减100的促销活动。这三个针对税改专场，在化妆品、婴幼儿食品、服装、玩具、进口零食、饮料等几类商品进行促销。</p><p style=\"line-height: 2em;\">　　但是在4月25日蜜芽主页上并没有看到类似的促销活动。以蜜芽自营的荷兰诺优能婴幼儿奶粉1段850g为例，4月11日的售价133元，包含税费和运费，由保税仓发货，最少两罐起订，可以使用商家提供的优惠券。但在4月25日，该款产品同样只能以两罐形式售卖，但是价格却有所降低，标价为248两瓶。当点击进入结算页面时才发现，原来这个价格并不包含进口税，进口税费显示为29.52元，符合11.92%的税率。结算总价为277.52元，平均单罐价格为138.76元，比4月11日上涨了约5元并不能使用优惠券。</p><p style=\"line-height: 2em;\">　　同样以自营的荷兰诺优能婴幼儿奶粉1段850g为例，网易考拉海购价格为108元，丰趣海淘178元，与4月11号显示价格无异，但是均显示无货状态。仔细观察，网易考拉售价虽然不变，但是在商品描述中的发货地已经悄然从广东保税1号仓变为香港。联系客服表示，如果从香港仓发货产生税费，将由顾客先行垫付，网易考拉将返还顾客代缴的税费。</p><p style=\"line-height: 2em;\">　　与单瓶不同，三瓶装网易考拉海购自营的荷兰诺优能婴幼儿奶粉1段850g网页上显示售价为354元，状态为有货，杭州保税3号仓发货，在结算页面显示还需收取38.56元税费，但是能用满299减30的优惠券，结算后总价为362.56元，平均每瓶奶粉价格为120.85元，高出4月11日单瓶108元12.85元。而这高出的12.85元恰恰和11.9%的税率相当。</p><p style=\"line-height: 2em;\">　　曾在11日首页上贴出“比海外更便宜，原装进口税额全返”的天猫国际在25日也没有延续之前的“包税”活动，在25日点击进入该平台网站，发现这个活动已经撤销，甚至在首页都看不见有类似的活动。苏宁海外购推出的“海外新风尚，税改不加价”活动到19日截止，目前也没有延续下去。</p><p style=\"line-height: 2em;\">　　纵观各大电商平台网站，商家推出的包税、免税、返税的产品多是局限在奶粉、纸尿裤、玩具、进口零食等小件商品，且基本税率都在11.9%的品类内，而高税率的商品基本都没有参与活动，不少热销产品仅仅售出一百多件就宣布无货。</p><p style=\"line-height: 2em;\">　　“包税”背后的真相</p><p style=\"line-height: 2em;\">　　有分析指，此次的税改给跨境电商带来了不小的冲击，不少商品本身获利空间就不大，许多“爆款”本身就是贴钱在换用户。而且目前包税清货商品多为4月8日税改之前就已经在仓或是在运输途中的商品，这些商品数量有限，包税活动肯定不会持久，这种“包税”也只是在目前政策不明朗的情况下一种过渡手段罢了，毕竟都是商家在倒贴钱。</p><p style=\"line-height: 2em;\">　　“这与网络约车的补贴大战一样，都是商家为了先保住份额的举动，但肯定不会是长期的行为，最多在新税制实施的前一两周会搞搞这类活动，但不会常态化。”有电商人士表示，包税策略会持续多久可能也是此轮跨境电商的一项竞争内容。</p><p style=\"line-height: 2em;\">　　万国优品总经理张宗涛向雨果网表示，表面上这是一次促销活动，本质上是一场战争，“平台商家包税是一次大型电商借助新政机会整合行业、淘汰中小电商的行动，在战争过后，价格将回归原位。”</p><p style=\"line-height: 2em;\">　　“目前保税仓的库存商品还可以正常清关，但这也是最后一批库存，在赚得眼球的同时，还能尽快把这部分库存变现了，以后政策的变化具有很大的不确定性。”一帆海购网总经理薛寿能表示，“另一方面，包税以后的价格实际上大多是上涨了的，或者真正落到实处的优惠减少了”。</p><p style=\"line-height: 2em;\">　　与此相验证的是，许多跨境电商人士透露，在4月8日后保税仓的货物基本只出不进，备货仅仅可供20天左右。不少商家连夜把保税仓货物运往香港、日本等地。</p><p style=\"line-height: 2em;\">　　税改正面清单要求进口电商企业参照一般贸易进口的商品标准，很多企业做不到，所以商品即使是在正面清单内，商品将来也无法在保税仓发货，因为无法满足“一线”进区要求。</p><p style=\"line-height: 2em;\">　　鉴于无法采用保税仓发货形式，不少商家转向海外仓发货或国外直邮，但是随之而来的运输成本和过长耗时也让跨境电商望而却步。</p><p style=\"line-height: 2em;\">　　亚健康模式下的“包税”</p><p style=\"line-height: 2em;\">　　有消费者表示，税改之前许多平台就有打折活动，屯了好多货。在税改出台后海淘感觉并没有什么变化，税都商家包了，有的东西甚至还比之前便宜。</p><p style=\"line-height: 2em;\">　　之前有报道指出，在去年平台竞争最激烈的时候，一包代购成本为150元的纸尿裤可以以亏损68元的价格卖出，只为了换取用户，但是这一行径也让跨境电商受伤不浅，光是纸尿裤这一项就能让电商平台一年损失一千多万。而如今，不仅价格不能涨，连税都要商家“包”了。</p><p style=\"line-height: 2em;\">　　“所谓的包税、免税、返税，不过都是商家的促销手段罢了，把直接的降价说成免税更能吸引买家，但确确实实是商家自己进行的补贴，因为没有谁能在进口环节少缴税。”</p><p style=\"line-height: 2em;\">　　张宗涛认为，在新政条件下，如果商品仍是由保税区发货，在同等价格情况下，商家很难通过“包税”将11.9%的税收成本完全控制消化掉。</p><p style=\"line-height: 2em;\">　　从长期来看，这种商家“包税”模式并不健康。这只是商家利用资金换取流量的传统模式，与一般促销模式差异不大。薛寿能认为，违背长期政策的营销活动只是暂时的过渡而已，包税促销肯定是不可持续，等以后消费者慢慢适应了税收政策，就会回到正常的销售。</p><p><br/></p>', '', '', '', '0', '1', '0', '1437347016', '', '0', 'http://', '', '100', '0');
INSERT INTO `hunuo_article` VALUES ('120', '12', '电商横扩趋势加速家电行业升级', '<p style=\"text-indent: 2em; line-height: 2em;\">近日，国家发改委等多个部委制定并发布了《关于促进消费带动转型升级的行动方案》，文中明确表示，为带动产业结构的进一步升级，将发掘农村电商消费的市场潜力，鼓励重点建设县级电商运营服务中心和改造乡村信息化综合经营服务网点。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">去年O2O商业模式成井喷式爆发态势，以外卖、专车等新兴行业进击势头尤为迅猛，究其根本，这些现象的出现都源于网络时代的进一步加速与推进，轻量化，便捷化的商业模式更符合当下年轻消费者群体的消费习惯，而这一部分人已逐渐转变成社会消费主体的中坚力量。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">近期互联网舆论也颇不平静，以家电零售行业热议“告同行书”为契机，舆论对当下家电零售存在的销售弊端观点明确，传统连锁卖场的运营模式已难以切入现阶段的主流消费市场。从线下传统渠道的垄断时代，再到近几年以京东为代表的线上渠道的崛起，在这样的行业趋势下，苏宁、国美等传统渠道也开始火速向互联网转型。昔日的线下垄断局面在今日看来已经成为助力线上渠道火爆的铺垫，这也从侧面加速了消费者对线上卖场的认可度和依赖性。</p><p><br/></p><p style=\"text-indent: 2em; line-height: 2em;\">由此可见，电商的加速横扩趋势愈发明显，覆盖范围愈来愈广，就各行业来看，继服饰、餐饮、3C等领域之后，家电行业已成为国民互联网化的下一个蓝海市场，线上渠道借助于产业模式的便捷性，更受时下消费者的青睐。记者曹婧逸</p><p><br/></p>', '', '', '', '0', '1', '0', '1437347036', '', '0', 'http://', '', '100', '0');
