INSERT INTO `hunuo_mail_templates` VALUES ('1', 'send_password', '1', '密码找回', '<p>{$user_name}您好！<br />\r\n<br />\r\n您已经进行了密码重置的操作，请点击以下链接(或者复制到您的浏览器):<br />\r\n<br />\r\n<a target=\"_blank\" href=\"{$reset_email}\">{$reset_email}</a><br />\r\n<br />\r\n以确认您的新密码重置操作！<br />\r\n<br />\r\n{$shop_name}<br />\r\n{$send_date}</p>', '1458309051', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('2', 'order_confirm', '0', '订单确认通知', '<p>亲爱的{$order.consignee}，你好！   我们已经收到您于 {$order.formated_add_time} 提交的订单，该订单编号为：{$order.order_sn} 请记住这个编号以便日后的查询。  {$shop_name} {$sent_date}</p>', '1437522784', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('3', 'deliver_notice', '1', '发货通知', '亲爱的{$order.consignee}。你好！</br></br>\n\n您的订单{$order.order_sn}已于{$send_time}按照您预定的配送方式给您发货了。</br>\n</br>\n{if $order.invoice_no}发货单号是{$order.invoice_no}。</br>{/if}\n</br>\n在您收到货物之后请点击下面的链接确认您已经收到货物：</br>\n<a href=\"{$confirm_url}\" target=\"_blank\">{$confirm_url}</a></br></br>\n如果您还没有收到货物可以点击以下链接给我们留言：</br></br>\n<a href=\"{$send_msg_url}\" target=\"_blank\">{$send_msg_url}</a></br>\n<br>\n再次感谢您对我们的支持。欢迎您的再次光临。 <br>\n<br>\n{$shop_name} </br>\n{$send_date}', '1194823291', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('4', 'order_cancel', '0', '订单取消', '亲爱的{$order.consignee}，你好！ \n\n您的编号为：{$order.order_sn}的订单已取消。\n\n{$shop_name}\n{$send_date}', '1156491130', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('5', 'order_invalid', '0', '订单无效', '亲爱的{$order.consignee}，你好！\n\n您的编号为：{$order.order_sn}的订单无效。\n\n{$shop_name}\n{$send_date}', '1156491164', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('6', 'send_bonus', '0', '发红包', '亲爱的{$user_name}您好！\n\n恭喜您获得了{$count}个红包，金额{if $count > 1}分别{/if}为{$money}\n\n{$shop_name}\n{$send_date}\n', '1156491184', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('7', 'group_buy', '1', '团购商品', '亲爱的{$consignee}，您好！<br>\n<br>\n您于{$order_time}在本店参加团购商品活动，所购买的商品名称为：{$goods_name}，数量：{$goods_number}，订单号为：{$order_sn}，订单金额为：{$order_amount}<br>\n<br>\n此团购商品现在已到结束日期，并达到最低价格，您现在可以对该订单付款。<br>\n<br>\n请点击下面的链接：<br>\n<a href=\"{$shop_url}\" target=\"_blank\">{$shop_url}</a><br>\n<br>\n请尽快登录到用户中心，查看您的订单详情信息。 <br>\n<br>\n{$shop_name} <br>\n<br>\n{$send_date}', '1194824668', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('8', 'register_validate', '1', '邮件验证', '{$user_name}您好！<br><br>\r\n\r\n这封邮件是 {$shop_name} 发送的。你收到这封邮件是为了验证你注册邮件地址是否有效。如果您已经通过验证了，请忽略这封邮件。<br>\r\n请点击以下链接(或者复制到您的浏览器)来验证你的邮件地址:<br>\r\n<a href=\"{$validate_email}\" target=\"_blank\">{$validate_email}</a><br><br>\r\n\r\n{$shop_name}<br>\r\n{$send_date}', '1162201031', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('9', 'virtual_card', '0', '虚拟卡片', '亲爱的{$order.consignee}\r\n你好！您的订单{$order.order_sn}中{$goods.goods_name} 商品的详细信息如下:\r\n{foreach from=$virtual_card item=card}\r\n{if $card.card_sn}卡号：{$card.card_sn}{/if}{if $card.card_password}卡片密码：{$card.card_password}{/if}{if $card.end_date}截至日期：{$card.end_date}{/if}\r\n{/foreach}\r\n再次感谢您对我们的支持。欢迎您的再次光临。\r\n\r\n{$shop_name} \r\n{$send_date}', '1162201031', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('10', 'attention_list', '0', '关注商品', '亲爱的{$user_name}您好~\n\n您关注的商品 : {$goods_name} 最近已经更新,请您查看最新的商品信息\n\n{$goods_url}\r\n\r\n{$shop_name} \r\n{$send_date}', '1183851073', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('11', 'remind_of_new_order', '0', '新订单通知', '亲爱的店长，您好：\n   快来看看吧，又有新订单了。\n    订单号:{$order.order_sn} \n 订单金额:{$order.order_amount}，\n 用户购买商品:{foreach from=$goods_list item=goods_data}{$goods_data.goods_name}(货号:{$goods_data.goods_sn})    {/foreach} \n\n 收货人:{$order.consignee}， \n 收货人地址:{$order.address}，\n 收货人电话:{$order.tel} {$order.mobile}, \n 配送方式:{$order.shipping_name}(费用:{$order.shipping_fee}), \n 付款方式:{$order.pay_name}(费用:{$order.pay_fee})。\n\n               系统提醒\n               {$send_date}', '1196239170', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('12', 'goods_booking', '1', '缺货回复', '亲爱的{$user_name}。你好！</br></br>{$dispose_note}</br></br>您提交的缺货商品链接为</br></br><a href=\"{$goods_link}\" target=\"_blank\">{$goods_name}</a></br><br>{$shop_name} </br>{$send_date}', '0', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('13', 'user_message', '1', '留言回复', '亲爱的{$user_name}。你好！</br></br>对您的留言：</br>{$message_content}</br></br>店主作了如下回复：</br>{$message_note}</br></br>您可以随时回到店中和店主继续沟通。</br>{$shop_name}</br>{$send_date}', '0', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('14', 'recomment', '1', '用户评论回复', '亲爱的{$user_name}。你好！</br></br>对您的评论：</br>“{$comment}”</br></br>店主作了如下回复：</br>“{$recomment}”</br></br>您可以随时回到店中和店主继续沟通。</br>{$shop_name}</br>{$send_date}', '0', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('15', 'verify_mail', '1', '绑定邮箱验证模板', '尊敬的{$user_name}您好！\r\n您于 {$send_date} 申请修改邮箱，点击以下链接，即可进行修改为保障您的帐户安全，请在24小时内点击该链接，您也可以将链接复制到浏览器地址栏访问 \r\n{$email} <br>\r\n{$shop_name}\r\n{$send_date}', '1228373714', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('16', 'ch_email', '1', '验证邮箱', '尊敬的{$user_name}您好！<br><br>\r\n您于 {$send_date} 验证邮箱，点击以下链接，即可进行验证\r\n<br>为保障您的帐户安全，请在24小时内点击该链接，您也可以将链接复制到浏览器地址栏访问 {$email} <br>\r\n{$shop_name}<br>{$send_date}', '1228373714', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('17', 'reset_surplus_password', '1', '重置余额支付密码', '亲爱的{$user_name}，您好！<br>\r\n<br>\r\n您已经进行了重置余额密码的操作，请点击以下链接(如果不能点击，请将它复制到您的浏览器并打开):<br>\r\n<br>\r\n<a href=\"{$reset_link}\">{$reset_link}</a><br>\r\n<br>\r\n以确认您的新余额支付密码重置操作！<br>\r\n<br>\r\n{$shop_name}<br>\r\n{$send_date}', '0', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('18', 'reg_email_code', '1', '注册验证', '<div id=\"qm_con_body\">\r\n<div style=\"\" id=\"mailContentContainer\" class=\"qmbox qm_con_body_content\">\r\n<p style=\"margin:0px;padding:0px;\"><strong style=\"font-size:14px;line-height:24px;color:#333333;font-family:arial,sans-serif;\">亲爱的用户：<></p>\r\n<p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:\'宋体\',arial,sans-serif;\"><span style=\"font-size: larger;\">您好！</span></p>\r\n<p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:\'宋体\',arial,sans-serif;\"><span style=\"font-size: larger;\">非常</span><span style=\"font-size: larger;\">感谢您</span><span style=\"font-size: larger;\">进行注册</span><span style=\"font-size: larger;\">。您当前正在进行邮箱注册验证，请在注册页面的邮箱验证码输入框中输入此次验证码：</span></p>\r\n<p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:\'宋体\',arial,sans-serif;\"><span style=\"color: rgb(51, 102, 255);\"><span style=\"font-size: larger;\">{$email_code}</span></span><span style=\"font-size: larger;\"> </span><span style=\"font-size: larger;\">验证码的有效时间为30分钟，请在有效时间内以完成验证。</span></p>\r\n<p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:\'宋体\',arial,sans-serif;\"><span style=\"font-size: larger;\">如非本人操作，请忽略此邮件，由此给您带来的不便请谅解！</span><span style=\"font-size: medium;\"> </span></p>\r\n<p>{$shop_name}<br />\r\n<span style=\"border-bottom:1px dashed #ccc;\">{$send_date}</span></p>\r\n</div>\r\n</div>', '1438733789', '0', 'template');
INSERT INTO `hunuo_mail_templates` VALUES ('19', 'email_validate', '1', '邮箱验证申请', '<div id=\"qm_con_body\">\r\n<div class=\"qmbox qm_con_body_content\" id=\"mailContentContainer\" style=\"\">\r\n<p style=\"margin:0px;padding:0px;\"><strong style=\"font-size:14px;line-height:24px;color:#333333;font-family:arial,sans-serif;\">亲爱的用户：<></p>\r\n<p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:\'宋体\',arial,sans-serif;\"><span style=\"font-size: larger;\">您好！</span><span style=\"font-size: larger;\"><br />\r\n</span></p>\r\n<p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:\'宋体\',arial,sans-serif;\"><span style=\"font-size: larger;\">您当前正在进行邮箱身份验证，请在页面的邮箱验证码输入框中输入此次验证码：</span></p>\r\n<p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:\'宋体\',arial,sans-serif;\"><span style=\"color: rgb(51, 102, 255);\"><span style=\"font-size: larger;\"><span style=\"border-bottom: 1px dashed rgb(204, 204, 204); z-index: 1;\">{$email_code}</span></span></span><span style=\"font-size: larger;\"> </span><span style=\"font-size: larger;\">验证码的有效时间为30分钟，请在有效时间内完成验证。</span></p>\r\n<p style=\"margin:0px;padding:0px;line-height:24px;font-size:12px;color:#333333;font-family:\'宋体\',arial,sans-serif;\"><span style=\"font-size: larger;\">如非本人操作，请忽略此邮件，由此给您带来的不便请谅解！</span><span style=\"font-size: medium;\"> </span></p>\r\n<p>{$shop_name}<br />\r\n<span style=\"border-bottom:1px dashed #ccc;\">{$send_date}</span></p>\r\n</div>\r\n</div>', '1438746507', '0', 'template');
INSERT INTO `hunuo_mask` VALUES ('1', 's1', 'data/mask/1522379911597316213.jpg', '{\r\n        name:\'s1\',\r\n        cs:{\r\n            width:100,\r\n            height:100,\r\n            radius:50\r\n        },\r\n        drawC:function(ctx,params) {\r\n            ctx.beginPath();\r\n            ctx.moveTo(params.x,params.y + params.radius);\r\n            ctx.quadraticCurveTo(\r\n                params.x - (params.radius * 2),\r\n                params.y - (params.radius * 2),\r\n                params.x,\r\n                params.y - (params.radius / 1.5)\r\n            );\r\n            ctx.quadraticCurveTo(\r\n                params.x + (params.radius * 2),\r\n                params.y - (params.radius * 2),\r\n                params.x,\r\n                params.y + params.radius\r\n            );\r\n            ctx.closePath();\r\n        }\r\n    }', '1', '100');
INSERT INTO `hunuo_mask` VALUES ('2', 's2', 'data/mask/1530004731084162987.bmp', '{\r\n        name:\'s2\',\r\n        cs:{\r\n            width:100,\r\n            height:100\r\n        },\r\n        drawC:function(ctx,params) {\r\n            ctx.beginPath();\r\n            ctx.moveTo(params.x-params.width/2,params.y - params.height/2);\r\n            ctx.lineTo(params.x+params.width/2,params.y - params.height/2);\r\n            ctx.lineTo(params.x+params.width/2,params.y + params.height/2);\r\n            ctx.lineTo(params.x-params.width/2,params.y +params.height/2);\r\n            ctx.lineTo(params.x-params.width/2,params.y - params.height/2);\r\n            ctx.closePath();\r\n        }\r\n    }', '1', '100');
INSERT INTO `hunuo_mask` VALUES ('3', 's3', 'data/mask/1530004741828185180.bmp', '{\r\n        name:\'s3\',\r\n        cs:{\r\n            width:50,\r\n            height:50,\r\n            radius:50\r\n        },\r\n        drawC:function(ctx,params) {\r\n            ctx.beginPath();\r\n            ctx.arc(params.x,params.y,params.radius,0,Math.PI*2,true);\r\n            ctx.closePath();\r\n        }\r\n    }', '1', '100');
INSERT INTO `hunuo_mask` VALUES ('8', 's4', 'data/mask/1530004755403238971.bmp', '{\r\n        name:\'s4\',\r\n        cs:{\r\n            width:100,\r\n            height:100,\r\n            spacing:5\r\n        },\r\n        drawC:function(ctx,params) {\r\n            ctx.beginPath();\r\n            ctx.moveTo(params.x-params.width/2,params.y - params.height/2);\r\n            ctx.lineTo(params.x-params.spacing/2,params.y - params.height/2);\r\n            ctx.lineTo(params.x-params.spacing/2,params.y - params.spacing/2);\r\n            ctx.lineTo(params.x-params.width/2,params.y - params.spacing/2);\r\n            ctx.moveTo(params.x+params.spacing/2,params.y - params.height/2);\r\n            ctx.lineTo(params.x+params.width/2,params.y - params.height/2);\r\n            ctx.lineTo(params.x+params.width/2,params.y - params.spacing/2);\r\n            ctx.lineTo(params.x+params.spacing/2,params.y - params.spacing/2);\r\n            ctx.moveTo(params.x-params.width/2,params.y + params.spacing/2);\r\n            ctx.lineTo(params.x-params.spacing/2,params.y +params.spacing/2);\r\n            ctx.lineTo(params.x-params.spacing/2,params.y + params.height/2);\r\n            ctx.lineTo(params.x-params.width/2,params.y + params.height/2);\r\n            ctx.moveTo(params.x+params.spacing/2,params.y + params.spacing/2);\r\n            ctx.lineTo(params.x+params.width/2,params.y +params.spacing/2);\r\n            ctx.lineTo(params.x+params.width/2,params.y + params.height/2);\r\n            ctx.lineTo(params.x+params.spacing/2,params.y + params.height/2);\r\n        }\r\n    }', '1', '100');
