INSERT INTO `hunuo_supplier_article` VALUES ('1', '2', '微店不等于微商城，微店和微商城有什么区别', '<p>微店 ≠ 微商城，微商城 ≠ 微店，<a href=\"http://www.68ecshop.com\">68ecshop</a>技术帮您区分“微店”和“微商城”，一起来了解一下吧！</p><p>&nbsp;</p><p><strong>&nbsp; 使用方式：</strong></p><p>&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 微店，是一个第三方的APP，商家的店是开在这个APP上的，需要有这个APP才能运作，无法绑定微信公众号；</p><p><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 微商城，是在微信上的，不需要第三方的APP，需要通过绑定公众账号进行推广，商城就直接开在你的微信公众号上的。</p><p>&nbsp;</p><p><strong>&nbsp; 推广方式：</strong></p><p><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 微店，普遍依赖于朋友圈营销，效果因人而异，开发新客户比较困难，客户的黏度也会比较差，而且此营销方式向来被人唾弃；</p><p><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 微商城，可以通过公众账号进行传播，前期运营会比较吃力，可是一旦公众号运营起来，客户的黏度会比较好，回头客也比较多，</p><p>&nbsp;</p><p>是将来微营销想要做大做强的必然趋势。</p><p><br/></p>', 'yy', '', '微店', '0', '1', '1437518499', '', '0', 'http://www.68ecshop.com/article-1759.html', '', '2');
INSERT INTO `hunuo_supplier_article` VALUES ('2', '2', '盘点那些夹缝中火爆的APP：简单、快准狠', '<p>对APP淘金者而言，这是一个最好的时代，也是最坏的时代。</p><p>&nbsp;</p><p>移动互联网以智能手机为先锋，带着平板电脑、可穿戴设备左右护法，翻腾打滚的普及了5亿多用户。</p><p>&nbsp;</p><p>移动APP随之进入中兴时代，无数APP创业者满怀激情涌了进来，准备大展拳脚。可是，互联网巨头们早已占据了移动互联的各大入口，比如移动社交的\r\n手机qq和微信、手机安全的360、浏览器的UC。巨头肆虐横行，虽然有很多势单力薄的APP开发者落荒而逃，但也有一些剑走偏锋的APP取得巨大的成\r\n功。本文就盘点一下这些APP，希望给APP从业者以方法论和信心。</p><p>&nbsp;</p><p>1、MYOTee脸萌-简单粗暴拼脸软件</p><p>&nbsp;</p><p>第一个应该谈就是当前最热的脸萌，它是端午节期间火起来的一款拼脸软件，一夜之间App Store排名从百名之后一下冲到了榜首，许多微信微博用户的头像都是脸萌。主要功能就是用户自定义的发型、五官、服饰、风格等拼接设计自己的头像，并及时分享到社交网络供好友赏论。</p><p>&nbsp;</p><p>给人的感觉就是，突然之间，人人都在用，其实这款应用2013年8月份就上线了，这段时间到2014年5月，可以说是脸萌的积累期、发酵期。\r\n2014年儿童、端午节就是脸萌的爆发期，比如宏民，我有2000个微信好友，也就是在端午节之前，微信朋友圈从来没有见过有人使用脸萌，端午节和节后就\r\n已经是刷屏了。有数据显示，从5月30日脸萌 iOS和Android 端下载量13万，然后每天下载量增加1倍，目前，脸萌已经拥有2000万用户。</p><p>&nbsp;</p><p>2、魔漫相机-幽默漫画拍摄软件</p><p>&nbsp;</p><p>魔漫相机是一款将真人拍成幽默漫画的相机，用户只需简单的拍照，选取各种风格的背景，就可以将自己的形象做成各式各样搞怪模样，然后可以直接发到社交平台。</p><p>&nbsp;</p><p>魔漫相机这款软件，还有脸萌、百度魔图、美拍等几款软件的发展轨迹、用户群体十分相似，而且都是人物形象编辑软件，以致于很多评论文章都将它们放在一起讨论。宏民总结了各家观点认为，这几款“人脸”软件发展特征：</p><p>&nbsp;</p><p>(1)简简单单的让用户搞怪、开心。</p><p>&nbsp;</p><p>(2)借助微信、微博等社交平台。</p><p>&nbsp;</p><p>(3)昙花一现，培养并满足用户新奇感，随后走向沉淀。</p><p>&nbsp;</p><p>很多人会认为是火一下就死了，宏民不太认同，请记住，这些产品的团队往往只有几个到十几个人，以极小的成本迅速火爆，相比于微信、微博等数百、数千\r\n的运营团队，在品牌、用户数等方面已经是取得巨大成功。走向沉寂后，可以继续开发其他产品，或者维护高潮后留存的用户。其实，一个APP真实用户能过百\r\n万，对于国内大量开发者来说，已经是不小的成功了!</p><p>&nbsp;</p><p>3、微软小冰-接受你的调戏</p><p>&nbsp;</p><p>2014年5月29日微软Bing搜索发布一款智能聊天机器人“微软小冰”，就是一个微信号，用户添加为其为好友之后，便可以进行智能对话。小冰在\r\n微信用户的渗透率不得而知，宏民所在的群里几乎都有了小冰的身影。官方数据显示，到5月31日，小冰加入的微信群攀升至150万，以平均每个群有7个人计\r\n算，小冰的好友数量超过千万。2天覆盖千万用户，这也是一款成功的产品。</p><p>&nbsp;</p><p>在人与智能设备互动的时候，我有一个观点，只要智能设备有3岁孩子的智商，人们就会认为“哇，它好厉害啊!居然能xxxx”，因为一个“东西”居然能做一点点的“人事”，人们当然会感到惊奇。So，天天面对身边那么聪明的人，你难道不应该更惊奇吗?</p><p>&nbsp;</p><p>藉此，我认为，微软小冰的流行同样是人们的新鲜感、好奇心在驱使，一旦人们对其十分熟悉，活跃度有可能会大幅下降!还有一点，小冰在某个群里往往会成为该群最活跃的用户，而微信群的本质是人与人交流，而不是人与机器交流，时间久了，人们自然会排斥这个机器人。</p><p>&nbsp;</p><p>4、无秘-快速模仿、和微信贴身格斗</p><p>&nbsp;</p><p>大概在2014年4月份，无秘(原名 秘密)开始在微信朋友圈传播开来，键人第一次知道它就是通过微信。该软件打着“朋友圈的匿名爆料”的口号，鼓励用户通过微信邀请朋友注册。上线仅一天，“无秘”就登上App Store总榜第13位，社交榜第1位。</p><p>&nbsp;</p><p>无秘的火爆，分析有两个，一是模式新颖，迅速将美国的Secret带到国内。二是和微信贴身格斗，积极拥抱国内第一大移动社交软件微信，不仅口号让\r\n人“朋友圈的匿名爆料”让人联想到微信的朋友圈，而且该软件除了访问用户的电话簿，还要访问微信朋友圈，贴微信的招数可以说牛逼呀!</p><p>&nbsp;</p><p>5、疯狂猜图-简单的小游戏</p><p>&nbsp;</p><p>这款游戏2013年4月12日上线，一个月的时间，下载量达到了5000万，日活跃度最高可达到700万，还得到250万美元来自启明创投融资。去年某段时间，身边的人吃饭、上班都在猜图，微信朋友圈也刷屏猜图。</p><p>&nbsp;</p><p>虽然这款应用沉寂了，但是再不济有不少的忠实用户。</p><p>&nbsp;</p><p>一个人的思维毕竟有限，为了挖掘更多在夹缝中火爆逆增长的手机软件应用，宏民求助了微信朋友圈。</p><p>&nbsp;</p><p>几位微信好友推荐的有：</p><p>&nbsp;</p><p>找你妹、</p><p>&nbsp;</p><p>表情帝、</p><p>&nbsp;</p><p>Candy Crush、</p><p>&nbsp;</p><p>PopStar!消灭星星、</p><p>&nbsp;</p><p>陌陌、</p><p>&nbsp;</p><p>遇见、</p><p>&nbsp;</p><p>等等......</p><p>&nbsp;</p><p>如果你还没有听说过这些软件，建议去主动了解下，发现其成功点，一定能对你带来巨大的帮助。</p><p>&nbsp;</p><p>总结下吧，希望本文可以给那些面对激烈竞争而心生怯意的互联网从业者以信心，明朝时就有人说，“社会真黑暗、竞争真激烈，失去希望了”，到了今天依然有人说这句话，负面情绪只是历史车轮中的边角料而已，重要的是，你是不是一个好的模仿者和创造者。</p><p><br/></p>', 'yy', '', '', '0', '1', '1437518607', '', '0', 'http://www.68ecshop.com/article-1517.html', '', '2');
INSERT INTO `hunuo_supplier_article` VALUES ('3', '7', '当营销无处不在时，社会化媒体也无力挽救', '<p><strong>导读：</strong>一个个的热点被制造出来，又迅速消失。当热点越来越多，目不暇接，然后人们就开始对于营销热点越来越麻木。</p><p>　　在过去几年间，我一直在观察营销在各类社会化媒体平台上的演变和发展，并参与其中。从论坛到微博，再到微信，我们已经至少经历了三代的社会化媒体的变迁和更迭。</p><p>　　而最近一段时间，我的观察和反思给我的最真切的感受却是，社会化营销的威力正在下降，甚至面临着失效的危险。</p><p>　　<strong>社会化媒体已全部沦陷</strong></p><p>　　在05、06年的时候，在论坛里写一篇软文做一次植入营销是一件很容易的事情。因为，那时候，论坛里氛围还是比较单纯的，很多企业远还未意识到论坛里的口碑营销的价值。而到了07、08年之后，越来越多的水军侵入到论坛，网站管理员和版主艰苦的跟“水军”做着斗争。</p><p>　　不过在企业做社会化营销的强烈需求的推动下，大量的马甲在论坛里成批的出现，一些自动发帖软件被开发出来。于是，论坛里垃圾的广告贴越来越多，论坛生态被破坏，人们开始逃离，论坛开始走向衰落。</p><p>　　然后，在2009年8月，新浪成为国内第一家开放微博服务的门户网站，由此开启了微博为主导的社会化营销的时代。而微博几乎是重复了论坛的衰落\r\n老路，大量的企业和政府微博入驻，大量的营销账号在利益的驱动下被成批的制造，在淘宝上更是出现了大量的微博增粉和转发评论的商家，成千上万的僵尸账户被\r\n营销软件公司制造出来。</p><p>　 \r\n　就在很多用户发愁一个月长不了10个粉丝的时候，在淘宝上花10块钱就能直接涨1万个僵尸粉。而在新浪微博的大力推功和支持下，更多的企业账号涌入微 \r\n博，并将其作为社会化营销的主流阵地，大量的早安晚安心灵鸡汤和企业的产品消息，通过专门的微博运营人员每天持续的被制造，并定时推送给他们的粉丝们。</p><p>　　微博开始被企业、媒体、政府、营销等账号彻底占领，微博生态被破坏，人们开始陆续逃离。</p><p>　　而在今天，正如日中天的微信似乎似乎也正走在老路上。或许在普通用户的眼里，微信不过是一个社交工具，但在很多企业和营销公司眼里，微信现在俨然就是一个社会化营销的平台。</p><p>　 \r\n　微信公众号、朋友圈、微信头像、签名甚至朋友圈的相册封面等，都已经开始被彻底开发成了一个个可供营销的资源。在很多人关注到微商的泛滥对微信朋友圈生\r\n \r\n态的破坏时，事实上目前对微信朋友圈这个社会化媒体平台的生态破坏最为严重的却是越来越多的企业将微信作为营销的阵地，并将将精力逐步从微博转移到了微信\r\n 上。</p><p>　　而且，相对微博这样的由松散和广泛的好友关系组成的社会化媒体不同的是，微信是一个强社交关系的平台，一旦大量的企业将微信作为重 \r\n要的社会化营销平台，微信朋友圈的生态被破坏的更快。特别是在企业营销诉求的引导下，经常会有大量的好友在瞬间分享同一个信息之时，用户的朋友圈瞬间就会\r\n 造成刷屏。</p><p>　　而就在很多企业还在为刷屏的效果沾沾自喜时，很多用户却并不会因为刷屏而去关注企业真正想去传达的消息，反而会将哪些刷屏好 \r\n友的朋友圈悄悄的屏蔽，或者将本来就不熟的好友默默的删除好友。而当大量的好友之间开始试图解除好友关系，并被越来越多的不熟的好友刷屏骚扰，微信已经开\r\n 始走在论坛、微博们的老路上。</p><p>　　<strong>社会化营销是否正在失效?</strong></p><p>　　在今天，论坛已经渐渐无人问津，微博的衰落已是事实，而微信的疲态已经开始显现，但是新的平台级的社会化媒体平台还没有开始出现，目前的社会化营销时代看起来正在遭遇断层。这有几个明显的特征：</p><p>　　1、没有人再大红大紫</p><p>　 \r\n　在论坛时代的高峰时，制造了一大批的网络红人，他们有的已经消失匿迹，比如犀利哥，有的仍然活跃在这个时代，比如木子美，芙蓉姐姐、凤姐等;而在微博时\r\n \r\n代造就了天才小熊猫、留几手等红人;而在微信时代，截止到现在，并没有诞生真正红遍全网的网络红人或意见领袖，而更多的是以机构运作的商业账号，比如罗辑\r\n 思维。</p><p>　　甚至在2014年以来，包括论坛、微博和微信等所有社会化媒体上都没有现象级的网络红人再出现。当然，也有在小范围内走红的，比 \r\n如前段时间在微博小红一把的雷克。而在微信上，除了很多没有性格的自媒体文摘号或垂直圈子里的知名自媒体人外，并没有真正的红遍全网的红人出现。</p><p>　　2、没有品牌赖以成名</p><p>　　作为社会化营销的案例，小米在微博时代曾被频频提及。小米也通过自己微博矩阵，成功的让每一名员工参与到品牌传播的过程中，而在小米品牌的塑造过程，小米社区和微博曾是两个非常重要的阵地，小米也被塑造成为一个手机发烧友的时尚手机品牌，被广大的热血粉丝所追捧。</p><p>　 \r\n　还有杜蕾斯，这样一个原本国人难以启齿的安全套品牌，通过在微博上有趣的互动运营，吸引了众多的忠实拥趸，并将杜蕾斯打造成为一个时尚的品牌，以至于至\r\n 今还有企业把送杜蕾斯给自己的用户或客户作为一种创意或惊喜。而在微信时代，尽管不少企业通过微信公众号的运营和推广，吸引了众多的品牌粉丝，但目力所\r\n 及，还没有看到有一个品牌能够像小米或杜蕾斯那样在微博风行的时代受益如此之多。</p><p>　　3、没有产品因此畅销</p><p>　　也许提到帮助 \r\n产品进行销售这一点，很多人会否认。因为，在2014年，微商借助微信迅猛发展，很多做微商的朋友动辄晒出几十万甚至上百万的销售收入。然而，很多看似畅\r\n \r\n销的面膜微商真相被一一拆破，聊天记录和转账记录造假，传销的本质暴露，大量的面膜产品被压在下级代理手里，并没有真正到达消费者手中。不可否认的是，在\r\n 微信这个社会化营销平台上，成功的面膜微商案例大多只是包裹着传销性质的销售神话。</p><p>　　而一些做其他如农产品、土特产、手工艺品等产品的微 \r\n商，面临的困境却是在消费完有效的微信好友资源之后，无法进一步扩大自己到社交范围从而打开更大的市场。你或许还可以说，脸萌、足记不就是在微信上走红的\r\n 吗?可是他们走红的生命周期如此短暂，以至于在很多人刚下载下来准备体验的时候，产品流行的风潮已然过去。</p><p>　　<strong>当营销无处不在，就已开始失效</strong></p><p>　 \r\n　显而易见的是，当越来越多的企业投入到社会化营销的大潮中，社会化营销的各项手段就已经开始慢慢失效。一个个的热点被制造出来，又迅速消失。当热点越来\r\n \r\n越多，目不暇接，然后人们就开始对于营销热点越来越麻木，也越来难以被打动直至兴奋尖叫。而如果你一直在关注社会化营销的发展的话，你会发现，已经很久没\r\n 有听到或看到一个真正成功的营销案例了。</p><p>　　这并不是危言耸听。当营销成为生活的常态，当我们的世界随时随地被营销事件所包围，到处都是包装过的故事或报道，你越来越看不清楚这个世界本真的模样，就意味着人们越来越难以被营销故事所打动。</p><p>　　与此同时，一些从事运营、营销、公关和品牌的企业员工们，还在延续着自论坛时代就有的方法论，进行着品牌和产品的传播之路。制造、跟随、炒作热点，期望借助每一个社会公共事件或极端天气甚至人类灾难来进行借势营销。</p><p>　 \r\n　于是，我们看到，雾霾来了，企业的公关和文案忙碌起来，开始借势刷屏;沙尘暴来了。企业的公关和文案又忙碌起来，开始借势刷屏;坠机事件发生，各类新闻\r\n \r\n平台和app准备文案，忙着借势;春节、元宵节、情人节、五一劳动节、端午节、中秋节、母亲节、儿童节等等中外大小节日，无论是传统佳节还是舶来的洋节，\r\n \r\n统统都是营销的节点，刷屏!刷屏!刷屏!没有创意和新意，不管品牌与节日搭还是不搭，全部一哄而上。这些传统的把戏，甚至连普通的用户都熟知一二。而被营\r\n 销刷屏惯了的用户，早已审美疲劳，只是默默的掠过。</p><p>　　有时候，难道我们不应该好好想想吗?盲目借势，频繁刷屏、过度营销在社会化媒体的平台上真的是一个好手段吗?像脑白金那样的简单粗暴的洗脑式传播方法，在微博或微信上可能根本无效，甚至还会引起反作用。</p><p>　　因为，现在的用户比以往有更多的选择，也有更多的自由，当他厌烦了你在他的世界里像蚊子一样“嗡嗡作响”，他可以随时取消关注，屏蔽消息或者解除好友关系，而最可怕的则是他对你的营销信息选择性的忽略，那你将再也别想真正走入到他的内心。</p><p><br/></p>', 'yy', '', '', '0', '1', '1437529382', '', '0', 'http://www.68ecshop.com/article-1683.html', '', '7');
INSERT INTO `hunuo_supplier_article` VALUES ('4', '7', '“互联网+”下的全零售惠战 国美在线引领上半年电商行业最强战', '<p>4月19日，国美在线418“购物大趴-放肆一把”打响收尾战，经过大半月的418大促，在为消费者带来最贴心优惠的同时，也让众电商看到商机，天 \r\n猫、京东、苏宁易购等电商纷纷跟进。其中以国美在线声势最为浩大，线上“六大放肆”回馈消费者，线下牵手《速度与激情7》、送货大车开到京东大本营“约 \r\n架”以及将“418放肆一把”的广告打到纽约时代广场等，在营销上赚足眼球，为其成功打造上半年最大购物节奠定基础。根据国美在线官方公布的数据，4月 \r\n16日-19日，国美在线四天内交易额同比增长220%，无线同比增长740%，占比全站突破40%，再次实现电商行业增速奇迹。</p><p>&nbsp;&nbsp;&nbsp; 　<strong>电商促销大战达顶峰五一消费热潮提前燃烧</strong></p><p>　　从4月1日开始，国美在线就率先喊出418“放肆一把”的店庆大促口号。各种大力度优惠促销活动引发一波又一波抢购热潮，随后天猫、京东、1号店、苏宁易购等电商按捺不住纷纷加入418网购大战，将传统的五一消费热潮提前近半个月。</p><p>　　在此轮418电商网购价格战中，大家电、电子产品甚至黄金等成为各大电商的热推产品，而以国美在线声势最为浩大，线上、线下、无线端全零售渠道\r\n \r\n参与价格竞争，线上418元抢家电、家电报销买多少送多少等促销活动，比价京东贵就赔300，价保到五一等真低价服务保障，力保消费者安心放肆购;线下，\r\n \r\n“黄金72小时”家电跌破底价，全国多个地区的国美门店出现了市民排队抢购家电的情景。此外，135个城市上午下单下午送达的“计时达”快捷物流，30天\r\n 无理由退货，180天只换不修以及“家安保”售后延保服务;线上线下齐力，引领众电商将此次418网购大战推向最顶峰。</p><p><strong>　　线上放肆到底拼低价线下多渠道营销造大势</strong></p><p>　　此次418大促，国美在线再度刷新销售记录，骄人战绩的背后，离不开自始至终放肆到底的线上促销优惠。4月1日，国美在线即提前打响418购物\r\n \r\n大趴揭幕战，“万品开门红”主题大促，多种重磅优惠吸引消费者关注;4月4日-15日，国美在线又轮番推出一系列分品类大趴专场。16日-17日，418\r\n \r\n元家电每天6场“放肆抢”;5-8折大牌家电全额报销，买多少返多少现金券“放肆免”;更有低至4777元iPhone6、3599元索尼48英寸电视等\r\n \r\n单品“放肆购”;18日，老牟专场BOSS亲选爆款全天放血价，全场购买自营家电满20000返2000红券;活动期间，微信端发放418元、4180元\r\n \r\n两种现金红包“放肆领”，4180位老会员还享受全国包邮优厚待遇，此外，黄金每克209元、话费超值充41.8元抵50元、0元抽整车等也吸引了众多消\r\n 费者关注。</p><p>　　除线上史无前例的促销活动吸引关注外，国美在线还通过线下多渠道活动为线上促销造势，拉动整体销量。由于与《速度与激情7》的品牌理念非常贴 \r\n合，国美在线成为与《速度与激情7》唯一合作的亚洲电商平台;418大促期间，国美在线还将418红皮货车开到京东办公楼下，“东哥，418一起放肆一 \r\n把”巨幅邀约，凸显线上“真低价”大促全面约战京东，扩大418整体大促影响力。此外，4月14日，国美在线“418放肆一把”成功登上美国纽约时代广 \r\n场，为线上大促宣传造势，至此国美在线418购物大趴掀起最高潮。</p><p><strong>　　国美在线418同比增220%加速进军行业前三</strong></p><p>　　今年418，国美在线与线下门店双线联动，携手格力、海尔、美的、苹果、方太等一线大牌厂商，依靠国美家、微店等创新业务，共同打造了一场全零\r\n \r\n售购物狂欢盛宴。值得注意的是，以往的价格大战是线上通过价格透明对线下实体店造成一定的冲击，而此次国美在线418线上线下互通联动，今后将可能出现线\r\n \r\n上和线下的价格倒挂，对消费者而言更加透明。国美在线副总裁黄向平表示，“下棋讲究棋逢对手，用户只要通过对比，就能很清晰地购买到最具性价比、最满足切\r\n 实需求的商品”。</p><p>　　通过史无前例的促销优惠，国美在线418整体战绩突破新高，4月16日-19日，国美在线四天内交易额同比增长220%，无线同比增长 \r\n740%，占比全站突破40%，大家电销售突破32万台，iPhone6成为销售最快的热销产品，5秒内销售达1000台，黄金三天销售超1亿，新上线的\r\n 国美家和微店也表现抢眼，实现了自身业绩和口碑的又一次突破。</p><p>　　业内人士分析表示，通过此轮价格大战，国美在线418很可能会创造堪比下半年双11的零售规模。418购物大趴之后，国美在线将能呈现更加快速\r\n \r\n的增长态势，预计第二季度的增速或达150%，依托线下门店整体销售实力，国美在线将打响上半年电商行业“互联网+零售”战第一枪，向行业前三迈出坚实步\r\n 伐!</p><p><br/></p>', 'yy', '', '', '0', '1', '1437529500', '', '0', 'http://www.68ecshop.com/article-1691.html', '', '7');
INSERT INTO `hunuo_supplier_article` VALUES ('5', '2', '诺基亚若重回手机市场，价值何在？', '<p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">有消息称诺基亚最早明年将重返手机市场，芬兰诺基亚预计将在2016年从微软手中收回诺基亚品牌，据了解诺基亚旗下研究与孵化团队Nokia Technologies正在紧锣密鼓地筹备重返手机市场的计划。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　一年前诺基亚将手机部门出售给微软后，仅剩地图、网络设备和诺基亚技术三项业务，此次诺基亚可能将利用诺基亚技术重返手机市场。在智能手机正打得火热的当下，诺基亚如果选择回归，可能会在竞争激烈的智能手机市场站住一席之地，但是想要真正翻身恐怕很难。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　<strong style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">智能手机市场形势严峻</strong></p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　首先，硬件方面很难再搞出大名堂。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　目前智能手机市场面临着一个新品密集发布期，各大手机厂商争相在智能硬件市场大搞特搞后，智能机硬件创新渐止步，手机硬件方面似乎可以用饱和来形容了。除了传统老牌手机厂商力推新品外，行业外公司也争相挤进来凑热闹。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　虽然在2012年初，诺基亚发布过4100万像素的Lumia 1020，但那已经是几年前了。智能手机市场发展迅速，如今智能手机的拍照质量正在赶超小DC，索尼、努比亚、华为等智能手机争相向“手机超单反”迈进。在移动芯片市场上，高通和联发科地位牢固、居高不下。三星和海思将因内部需求而在移动芯片市场“幸存”下来，其他厂商则可能陷入困境，其他后来者自然也无法打入，硬件创新已开始止步。电池配置上，闪充技术正在普及，市场很多手机已经具备闪充技术。从诺基亚去年11月发布的Android 平板 N1来看，外观上有iPad mini 的影子，硬件配置上并未更多创新。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　除非诺基亚能从新兴市场寻找机遇，眼下若靠硬件技术为切入点，是很难打进拥挤的智能手机市场。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　其次，价格方面低端机再无市场。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　提起诺基亚，第一印象就是耐用不贵，很平民化，放在过去几年，高端价格市场还未饱和，低端市场还能有赚头。但是如今智能手机越来越便宜，行业重心逐渐向千元或百元市场转移，低端市场竞争激烈仿佛再无机会可用。近几年国产机的兴起和强盛，主要也是靠在低端市场占领份额。近期话题火热的“<a target=\"_blank\" href=\"http://www.iresearch.cn/search/xiaomi/\" style=\"border-width: 0px 0px 1px; border-bottom-style: dotted; border-bottom-color: rgb(128, 0, 128); font-size: 14px; margin: 0px; outline: none; padding: 0px; vertical-align: baseline; color: rgb(51, 51, 51); text-decoration: none;\">小米</a>们”在配置和用户体验上不断创新改进，大多是以高配置、低价格来满足大众需求，当然这是有很大效果的，除了赚足了眼球，让大家对其品牌影响深刻，也给智能手机市场带来了更大的进步。“小米们”已经将价格做到这种地步了，诺基亚再想分一杯羹极其困难。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　况且从诺基亚N1平板的市场反响就能看出其价格优势已不再。当初硬件配置和性能还不错的N1平板价格已经很良心了，但是销售反应平平，愿意去买的大多数人更多是因为诺基亚的品牌影响，而不是产品本身。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　所以，随着市场形势的变化，低端机已经无市场空间，诺基亚的价格优势也已不再。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　第三，仅靠品牌影响力很难做出压倒之势。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　诺基亚如今给人感觉是空洞和萧条，在消费者心中除了品牌，好像没剩什么了。诺基亚品牌在移动手机和移动设备领域具备很高的影响力，也有很大一部分诺粉，对于诺基亚的重返，很多人是表示期待和支持的，但这些老用户中能用实际行动去支持购买的其实不多。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　诺基亚的老用户群年纪已经偏大，且对手机不再有太多的需求和消费冲动。而现在的90后消费群体可能更偏向于苹果、小米、华为等现下正火热的品牌。靠消费其品牌影响力和为数不多的忠实粉丝，诺基亚能生存下来不成问题，但要逆袭很难。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　<strong style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">N1生产模式会被市场接受吗?</strong></p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　受限于微软，诺基亚目前还无法进行手机业务的开展，但这并不意味着他们放弃相关领域的所有工作，凭借第三方还是可行的。有分析称诺基亚会沿用去年的N1平板模式，即自己设计产品，把技术授权给其他厂商，由后者使用诺基亚的品牌进行生产、销售和经销。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　在技术上，诺基亚技术部门是确有实力的，该部门负责授权诺基亚旗下多达1万项以上的专利，诺基亚技术还在设计新产品，并将其授权给其他企业。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　但是如果选择由第三方来代工，用户会担心产品的安全性，而诺基亚本身也会失去原有的品牌意义，这种模式不一定会被消费者所接受。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　诺基亚的新转型可能不止在手机</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　目前手机市场竞争白热化，诺基亚作为一个老品牌应该很清楚当下形势。诺基亚正在寻求新的转变，若重返智能手机市场，可能并不专注于做手机。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　首先，其技术部门的品牌授权模式已经逐渐成熟，从该部门负责授权诺基亚旗下多达1万项以上专利的数据来看，诺基亚更大一部分的收入来源在品牌授权费上。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　其次，硬件市场前途不大，诺基亚可能转向瞄准软件服务市场，拓展和推广它的地图业务等。目前诺基亚还发展了很多大的科技项目，如一个与虚拟现实技术相关的项目，蓄势待发进军互联网市场。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; color: rgb(51, 51, 51); font-family: Arial, 宋体; background-color: rgb(255, 255, 255);\">　　另外，诺基亚前不久收购阿郎，在通信行业与华为、爱立信形成了业内三足鼎立的态势后，补齐了其运营商业务。未来，阿朗贝尔实验室、诺基亚FutureWorks和诺基亚技术公司三大研发主体将作为独立主体运营。</p><p style=\"border: 0px none; font-size: 14px; margin: 0px; outline: 0px none; padding: 0px; vertical-align: baseline; list-style-type: none; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; color: rgb(51, 51, 51); font-family: Arial,宋体; background-color: rgb(255, 255, 255);\">　　现在互联网手机的营销手段效果不会再大，随着近期几波手机新品热潮的冲击，消费者已经开始疲劳了，没有技术上的积累，诺基亚很难再挤入市场。不过诺基亚未来的发展不局限于手机，在其他领域和方面可能会带来大的改变，就让我们拭目以待吧!</p>', '', '', '', '0', '1', '1437695173', '', '0', 'http://', '', '2');
INSERT INTO `hunuo_supplier_article` VALUES ('6', '5', '当营销无处不在时，社会化媒体也无力挽救', '<p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none; color: rgb(102, 102, 102); font-family: 微软雅黑; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\"><strong style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">导读：</strong>一个个的热点被制造出来，又迅速消失。当热点越来越多，目不暇接，然后人们就开始对于营销热点越来越麻木。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　在过去几年间，我一直在观察营销在各类社会化媒体平台上的演变和发展，并参与其中。从论坛到微博，再到微信，我们已经至少经历了三代的社会化媒体的变迁和更迭。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　而最近一段时间，我的观察和反思给我的最真切的感受却是，社会化营销的威力正在下降，甚至面临着失效的危险。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　<strong style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">社会化媒体已全部沦陷</strong></p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　在05、06年的时候，在论坛里写一篇软文做一次植入营销是一件很容易的事情。因为，那时候，论坛里氛围还是比较单纯的，很多企业远还未意识到论坛里的口碑营销的价值。而到了07、08年之后，越来越多的水军侵入到论坛，网站管理员和版主艰苦的跟“水军”做着斗争。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　不过在企业做社会化营销的强烈需求的推动下，大量的马甲在论坛里成批的出现，一些自动发帖软件被开发出来。于是，论坛里垃圾的广告贴越来越多，论坛生态被破坏，人们开始逃离，论坛开始走向衰落。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　然后，在2009年8月，新浪成为国内第一家开放微博服务的门户网站，由此开启了微博为主导的社会化营销的时代。而微博几乎是重复了论坛的衰落老路，大量的企业和政府微博入驻，大量的营销账号在利益的驱动下被成批的制造，在淘宝上更是出现了大量的微博增粉和转发评论的商家，成千上万的僵尸账户被营销软件公司制造出来。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　 　就在很多用户发愁一个月长不了10个粉丝的时候，在淘宝上花10块钱就能直接涨1万个僵尸粉。而在新浪微博的大力推功和支持下，更多的企业账号涌入微 博，并将其作为社会化营销的主流阵地，大量的早安晚安心灵鸡汤和企业的产品消息，通过专门的微博运营人员每天持续的被制造，并定时推送给他们的粉丝们。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　微博开始被企业、媒体、政府、营销等账号彻底占领，微博生态被破坏，人们开始陆续逃离。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　而在今天，正如日中天的微信似乎似乎也正走在老路上。或许在普通用户的眼里，微信不过是一个社交工具，但在很多企业和营销公司眼里，微信现在俨然就是一个社会化营销的平台。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　 　微信公众号、朋友圈、微信头像、签名甚至朋友圈的相册封面等，都已经开始被彻底开发成了一个个可供营销的资源。在很多人关注到微商的泛滥对微信朋友圈生 态的破坏时，事实上目前对微信朋友圈这个社会化媒体平台的生态破坏最为严重的却是越来越多的企业将微信作为营销的阵地，并将将精力逐步从微博转移到了微信 上。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　而且，相对微博这样的由松散和广泛的好友关系组成的社会化媒体不同的是，微信是一个强社交关系的平台，一旦大量的企业将微信作为重 要的社会化营销平台，微信朋友圈的生态被破坏的更快。特别是在企业营销诉求的引导下，经常会有大量的好友在瞬间分享同一个信息之时，用户的朋友圈瞬间就会 造成刷屏。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　而就在很多企业还在为刷屏的效果沾沾自喜时，很多用户却并不会因为刷屏而去关注企业真正想去传达的消息，反而会将哪些刷屏好 友的朋友圈悄悄的屏蔽，或者将本来就不熟的好友默默的删除好友。而当大量的好友之间开始试图解除好友关系，并被越来越多的不熟的好友刷屏骚扰，微信已经开 始走在论坛、微博们的老路上。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　<strong style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">社会化营销是否正在失效?</strong></p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　在今天，论坛已经渐渐无人问津，微博的衰落已是事实，而微信的疲态已经开始显现，但是新的平台级的社会化媒体平台还没有开始出现，目前的社会化营销时代看起来正在遭遇断层。这有几个明显的特征：</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　1、没有人再大红大紫</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　 　在论坛时代的高峰时，制造了一大批的网络红人，他们有的已经消失匿迹，比如犀利哥，有的仍然活跃在这个时代，比如木子美，芙蓉姐姐、凤姐等;而在微博时 代造就了天才小熊猫、留几手等红人;而在微信时代，截止到现在，并没有诞生真正红遍全网的网络红人或意见领袖，而更多的是以机构运作的商业账号，比如罗辑 思维。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　甚至在2014年以来，包括论坛、微博和微信等所有社会化媒体上都没有现象级的网络红人再出现。当然，也有在小范围内走红的，比 如前段时间在微博小红一把的雷克。而在微信上，除了很多没有性格的自媒体文摘号或垂直圈子里的知名自媒体人外，并没有真正的红遍全网的红人出现。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　2、没有品牌赖以成名</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　作为社会化营销的案例，小米在微博时代曾被频频提及。小米也通过自己微博矩阵，成功的让每一名员工参与到品牌传播的过程中，而在小米品牌的塑造过程，小米社区和微博曾是两个非常重要的阵地，小米也被塑造成为一个手机发烧友的时尚手机品牌，被广大的热血粉丝所追捧。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　 　还有杜蕾斯，这样一个原本国人难以启齿的安全套品牌，通过在微博上有趣的互动运营，吸引了众多的忠实拥趸，并将杜蕾斯打造成为一个时尚的品牌，以至于至 今还有企业把送杜蕾斯给自己的用户或客户作为一种创意或惊喜。而在微信时代，尽管不少企业通过微信公众号的运营和推广，吸引了众多的品牌粉丝，但目力所 及，还没有看到有一个品牌能够像小米或杜蕾斯那样在微博风行的时代受益如此之多。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　3、没有产品因此畅销</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　也许提到帮助 产品进行销售这一点，很多人会否认。因为，在2014年，微商借助微信迅猛发展，很多做微商的朋友动辄晒出几十万甚至上百万的销售收入。然而，很多看似畅 销的面膜微商真相被一一拆破，聊天记录和转账记录造假，传销的本质暴露，大量的面膜产品被压在下级代理手里，并没有真正到达消费者手中。不可否认的是，在 微信这个社会化营销平台上，成功的面膜微商案例大多只是包裹着传销性质的销售神话。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　而一些做其他如农产品、土特产、手工艺品等产品的微 商，面临的困境却是在消费完有效的微信好友资源之后，无法进一步扩大自己到社交范围从而打开更大的市场。你或许还可以说，脸萌、足记不就是在微信上走红的 吗?可是他们走红的生命周期如此短暂，以至于在很多人刚下载下来准备体验的时候，产品流行的风潮已然过去。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　<strong style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">当营销无处不在，就已开始失效</strong></p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　 　显而易见的是，当越来越多的企业投入到社会化营销的大潮中，社会化营销的各项手段就已经开始慢慢失效。一个个的热点被制造出来，又迅速消失。当热点越来 越多，目不暇接，然后人们就开始对于营销热点越来越麻木，也越来难以被打动直至兴奋尖叫。而如果你一直在关注社会化营销的发展的话，你会发现，已经很久没 有听到或看到一个真正成功的营销案例了。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　这并不是危言耸听。当营销成为生活的常态，当我们的世界随时随地被营销事件所包围，到处都是包装过的故事或报道，你越来越看不清楚这个世界本真的模样，就意味着人们越来越难以被营销故事所打动。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　与此同时，一些从事运营、营销、公关和品牌的企业员工们，还在延续着自论坛时代就有的方法论，进行着品牌和产品的传播之路。制造、跟随、炒作热点，期望借助每一个社会公共事件或极端天气甚至人类灾难来进行借势营销。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　 　于是，我们看到，雾霾来了，企业的公关和文案忙碌起来，开始借势刷屏;沙尘暴来了。企业的公关和文案又忙碌起来，开始借势刷屏;坠机事件发生，各类新闻 平台和app准备文案，忙着借势;春节、元宵节、情人节、五一劳动节、端午节、中秋节、母亲节、儿童节等等中外大小节日，无论是传统佳节还是舶来的洋节， 统统都是营销的节点，刷屏!刷屏!刷屏!没有创意和新意，不管品牌与节日搭还是不搭，全部一哄而上。这些传统的把戏，甚至连普通的用户都熟知一二。而被营 销刷屏惯了的用户，早已审美疲劳，只是默默的掠过。</p><p style=\"border: 0px; font-size: 14px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　有时候，难道我们不应该好好想想吗?盲目借势，频繁刷屏、过度营销在社会化媒体的平台上真的是一个好手段吗?像脑白金那样的简单粗暴的洗脑式传播方法，在微博或微信上可能根本无效，甚至还会引起反作用。</p><p style=\"border: 0px none; font-size: 14px; margin: 0px; outline: 0px none; padding: 0px; vertical-align: baseline; list-style-type: none;\">　　因为，现在的用户比以往有更多的选择，也有更多的自由，当他厌烦了你在他的世界里像蚊子一样“嗡嗡作响”，他可以随时取消关注，屏蔽消息或者解除好友关系，而最可怕的则是他对你的营销信息选择性的忽略，那你将再也别想真正走入到他的内心。</p>', '', '', '', '0', '1', '1437699008', '', '0', 'http://', '', '5');
INSERT INTO `hunuo_supplier_article` VALUES ('8', '1', '从枝头到舌头，互联网卖水果年入2.4亿元', '<p>中国的水果消费正在改变全球水果产业链：澳大利亚把原来专门给日本种植的樱桃树砍掉，改种中国人喜欢的“中国樱桃”，南美洲的水果种植商每年根据中国农历春节时间节点来培育新品种，安排生产计划，以便赶上春节的黄金消费时间卖个好价钱。</p><p>\r\n					\r\n					</p><p>&nbsp;<a class=\"fancybox_content\" href=\"http://img.zdnet.com.cn/3/314/lie8B9LQvTS6.jpg?rand=25\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://img.zdnet.com.cn/3/314/lie8B9LQvTS6.jpg?rand=25\" alt=\"从枝头到舌头，互联网卖水果年入2.4亿元\"/></a></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>导读：</strong>中国的水果消费正在改变全球水果产业链：澳大利亚把原来专门给日本种植的樱桃树砍掉，改种中国人喜欢的“中国樱桃”，南美洲的水果种植商每年根据中国农历春节时间节点来培育新品种，安排生产计划，以便赶上春节的黄金消费时间卖个好价钱。</p><p><br/>　　所以，当联想集团高级副总裁陈绍鹏脱下IT战衣去担纲联想农业——佳沃集团的领头人，主攻高端水果，当联想控股董事局主席柳传志在互联\r\n网上到处卖“柳桃”的时候，意味着水果消费在爆发。原因无他，中国数亿中产阶层对高品质水果的消费在攀升。如果说联想佳沃是用“全产业链”的重装模式去满\r\n足这个市场，那么天天果园则是用电商的模式来服务中产阶层。因为易损耗，在网上卖普通的水果，自然难以比得过遍布大街小巷的水果摊点，但如果卖50元一斤\r\n的进口樱桃，则可以支付足够的成本来做冷链，保证水果的品质。</p><p>&nbsp;</p><h2>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 做生鲜电商很容易掉进亏损泥沼，天天果园是个例外。</h2><p><br/>　　这家深耕水果的垂直电商<strong>2013年的营业额达到2.4亿元</strong>，目前已实现盈亏平衡，预计今年的业绩还会翻番。</p><p><br/>　　相比过去的默默无闻，天天果园近一年来多次跻身电商业界热点。去年7月，天天果园联手美国西北樱桃协会和时任美国驻华大使骆家辉，在天\r\n猫和天天果园官网发起预售，一周内售出168吨樱桃;今年3月，天天果园获得锴明领投的数千万美元B轮融资;7月，天猫旗舰店水果生鲜类目下，天天果园以\r\n1665万元的销售额位列第一;8月，蒋方舟在天天果园大谈“互联网思维就是女性思维”;9月，又在国内首次推出了“水果险”。</p><p><br/>　　一时间，有人为天天果园的数据叫好，也有人批评其炒作凶猛。联合创始人赵国璋在接受《创业家》采访时，以一句“太极十年不出门，形意一年打死人”概括了公司5年来对供应链的锤炼。或许，这句话同样可以解释更多问题。</p><h2><br/><strong>　　</strong>樱桃单品切入</h2><p><br/>　　创始人王伟和赵国璋都是通信专业毕业的理工男，对互联网有天然的亲切感。当时看来，天天果园这个创业项目从两人熟悉的互联网行业切入水果生意，显得顺理成章。但回头看，这却是一步险棋。</p><p><br/>　　在天天果园创立的2009年，以淘宝、当当和京东为代表的中国电商业已经度过漫长的培育期，正酝酿着第一轮爆发。这些电商出售的多是服装、图书、数码家电等标准化产品，以水果为切入点的天天果园看似找到了一片蓝海。</p><p><br/>　　根据艾瑞咨询提供的时间轴，2009年国内只有三家生鲜电商，分别是成立于2005年的易果网、2009年3月成立的面向上海外籍人士的莆田网以及天天果园。这意味着在行业经验和冷链技术都不成熟的生鲜电商起步阶段，身为先锋的天天果园也会面临成为“先烈”的风险。</p><p><br/>　　赵国璋也坦言，“这个行业没有标杆，很多还要靠自己学习和摸索”。在上海农副产品集散地十六铺(目前已经被改造为黄浦江水上旅游中心)，王伟和赵国璋以“一辆车、三个人、一间小冷库”为起点，开始了在网上卖水果的历程。</p><p><br/>　　幸运的是，创业不久，两人遇到了美国西北樱桃协会的中国代表王淼。王淼的职责是将西北樱桃推广到中国，但他在实施的过程中发现，中国消\r\n费者对进口樱桃的认知度很低，普遍不习惯其爽脆的口感。即便是天天与水果打交道的传统批发市场，也并不清楚西北樱桃到底是什么。王淼迫切需要找到一个理想\r\n的推介渠道，而天天果园两位创始人勇于接受新事物的特质打动了他，双方的合作由此达成。这也是天天果园的关键一步，正是借助美国西北樱桃协会，王伟和赵国\r\n璋才以樱桃这一单品打开了局面，并接触到了进口水果的上游，为日后供应链的锤炼打下基础。</p><p><br/>　　实际上，选择樱桃切入鲜果电商，赵国璋还有他自己的看法。樱桃是一种“很难伺候”的水果，不仅保鲜期极短，储存要求还很高。让樱桃漂洋\r\n过海之后还如同刚摘下时那样新鲜，并且让消费者以最快的速度享用到，这要求天天果园对供应链有极强的掌控能力。“可能潜意识里也是找了一块最难啃的骨头，\r\n如果樱桃都能做好，还有什么水果不能做?” 赵国璋说，“而且相比香蕉和苹果，樱桃是性感、新鲜的，人见人爱——这恰恰是天天果园想要打造的品牌形象。”</p><p><br/>　　在深入原产地的过程中，美国当地果农的专注让赵国璋印象深刻。例如，西北地区种植樱桃的家族历史超过了一百年，如今已经延续至第四代;\r\n奇兰湖畔的格里格家族历时十年，才培育出酸甜适中的Ruby红宝石樱桃。当然，这一切源于美国政府对种子知识产权的保护，果农得以潜心几十年研究如何提升\r\n水果品质和培育新品种。</p><p><br/>　　与西北樱桃协会的合作逐渐成熟，天天果园也开始搜罗世界各地不同品种的樱桃。Ruby红宝石、红杉樱桃等品种，都通过天天果园实现首次出口。智利、新西兰和澳大利亚等南半球樱桃品种的引入，让中国的消费者可以在冬季尝鲜。</p><p><br/>　　<em>点评：天天果园能在短短5年时间里成为领先的进口水果电商平台，也是站在风口上，由于中国中产阶层的壮大，对进口水果的需求飙\r\n升，“中国市场的增长已经改变了整个全球的水果供应链，南半球很多水果种植的时候，会考虑中国市场，比如他们根据中国农历春节培育新品种，制定生产计划，\r\n以便能够在春节前两个星期发到中国来，效果跟春节后发到不一样，以前有些日本樱桃会在澳大利亚种植，满足日本市场，日本市场需求不旺盛，都砍掉了，都开始\r\n种中国喜欢的水果。”</em></p><p><br/><em>　　而中国人对新鲜事物接受度高，也让进口水果市场的培育容易很多，“中国人有一个优点，蛮开放的，国外很多好的新东西，基本都能\r\n接受，我们觉得很难卖的一些东南亚水果，榴莲、牛油果，销量增加非常快，在上海，榴莲和牛油果的销量真的很惊人。榴莲已经成为泰国对中国出口的获值最高的\r\n水果，远远超过龙眼等其他的产品。”</em></p><h2><br/>　　从枝头到舌头</h2><p><br/>　　“当你拿起一颗鲜艳饱满的樱桃时，三天前它还挂在美国果园的枝头。”从采摘到送达的时间不超过72小时，这是天天果园的承诺。</p><p><br/>　　在赵国璋的记忆里，过去在国内吃到的美国红蛇果，口感是软而酥的。直到亲口咬下刚采摘的红蛇果的那一刻，“咔嚓”的清脆声和透着汁液的\r\n新鲜感，完全颠覆了赵国璋对这一水果的认识。这也让他意识到，天天果园打造短而快的供应链的意义有多重大，这几乎可以颠覆中国人对于进口水果的固有印象。</p><p><br/>　　现代零售业自诞生起就是一门关于供应链的生意，从世界最大的零售商沃尔玛，到国内第一B2C电商京东，都是将物流建设放在了核心地位。而鲜果品类、长距离运输这两点，决定了天天果园的供应链必须更加高效。</p><p><br/>　　于是，天天果园与供应链的较劲过程，从果实采摘的那一刻就开始了。以樱桃为例，各地的果园为对抗不利于采摘的环境，都使出了浑身解数。</p><p><br/>　　樱桃的最佳保存温度是0-1摄氏度，采摘一般在清晨进行。而樱桃遇水容易腐烂，沾水的樱桃在阳光下也容易爆浆。如果遇到潮湿的天气，美\r\n国西北樱桃果园会出动直升机搅动气流，以利于樱桃表面露水的蒸发。冬天的霜冻对樱桃花苞的伤害也是致命的，于是在智利的果园里会有一排排底部生着火的风\r\n车，这是用来扩散热空气的。</p><p><br/>　　采摘下的樱桃立刻会进入包装厂进行预冷，在这一步，樱桃果心的温度降至零摄氏度。在此后的运输过程中让果心维持在零度，是樱桃保鲜的关键。接下来，打包好的樱桃经汽车运至航空港，再空运至中国。</p><p><br/>　　在传统的运输环节，进口水果到达中国后的路径是“批发市场—经销商—二级经销商—零售终端”，每个环节都可能发生冷链中断的情况。一旦\r\n断冷，樱桃果心的温度升至零度以上，即使后续有冷链接上，降低的也只是果肉的温度，果心很难再降至零度。经历的环节越多，暴露在常温或高温下的机会就越\r\n大，樱桃鲜度的损耗也就越大。赵国璋向《创业家》介绍，传统运输下的樱桃损耗率高达30%，这些成本最终由消费者埋单。</p><h2><br/>　　相比之下，天天果园的损耗率只有5%，这是怎么做到的?</h2><p><br/>　　天天果园在国内建立了上海、北京、深圳、杭州和成都5个分仓冷库，每个分仓可以辐射到周围的城市，目前可覆盖近100个城市。不要小看\r\n这5个冷库，在赵国璋的眼里，国内有些所谓的冷库不过是一个大“冰箱”。实际上，合格的冷库不仅温度要达标，还涉及到地表、湿度、保温材料和通风口的控制\r\n管理，甚至水果进库后的摆放朝向和货架高度等因素都会影响到保鲜效果。</p><p><br/>　　像奇异果、牛油果等保存时间较长的水果，天天果园还会通过甜度仪和压力计来定期检测成熟度，满足客户的不同需求。“去年我们推了一个叫\r\n‘Ready to \r\neat’的活动，即消费者收到的水果处于最适合吃的阶段，不必担心过熟来不及吃，或是没有熟还不能吃。这时候产品设计就很重要，不能卖二十个水果给用户，\r\n而是一次只卖四个或六个。” 赵国璋说。</p><p><br/>　　在天天果园的售后服务里，有一项特别的服务已经坚持多年：48小时内可以无理由退货。之所以称其特别，是因为生鲜商品几乎从未有过无理\r\n由退货的先例。即使是今年3月15日起实施的新消法，规定消费者有了“后悔权”，7日内可享受无条件退货，但也明确将生鲜易腐类商品排除在外。</p><p><br/>　　天天果园的做法不可谓不超前，赵国璋对此的解释是：“我们对自己的商品有信心，同时也让用户对我们有信心。但打心底里说，我们不希望用户退货，这些都是成本，所以推行48小时退货也是为了激励我们提升管理品质和经营效率。”</p><p><br/>　　为了尽可能地减少退货，在水果出库前，天天果园的拣货员还要做一道工序——再次对水果进行质检和挑选，剔除不适合出售的产品。</p><p><br/>　　经过这一系列供应链管控，天天果园出售的进口水果的平均价格可以比超市低20%左右。而在高端超市动辄几百元一斤的进口樱桃，在天天果园的售价不足50元每斤。</p><p><br/><em>　　点评：天天果园和京东一样，卖的不仅仅是水果，“我们不是一个水果供应商，其实你从我们那买的樱桃还包含了从美国到中国一系列的冷藏服务，就像买矿泉水一样，你买的矿泉水可能它的一大部分价值来自于物流，水本身含的价格是非常低的，我们提供的是水果服务。”赵国璋说。</em></p><h2><br/>　　专注与苛刻</h2><p><br/>　　“IT男有一个特点，思路直接，比较专注。”天天果园的员工这样评价两位创始人。</p><p><br/>　　正是由于创始人的专注，天天果园自成立起，就一直扎根在进口水果领域。这几年，像本来生活网、中粮我买网、顺丰优选等承载有机肉菜、水果、牛奶及五谷杂粮的综合生鲜平台不断涌现，但天天果园始终不为所动，坚持深耕自己最擅长的水果品类。</p><p><br/>　　从商业模式上看，天天果园是一家水果电商企业，但赵国璋对自己的定位是“水果大使”。</p><p><br/>　　“成立的第一年，天天果园就与美国西北樱桃协会和美国领事馆合作，我们做了一个在线的美国水果节。那时没有人愿意帮美国水果做推广，我\r\n们虽然很小，但是乐意把美国的樱桃、苹果、橙子、提子和布林介绍给中国消费者。后来我们又帮澳大利亚、新西兰等国家做水果节。我们就像水果大使一样，传递\r\n水果的知识和文化，顺便再做点商人的事情，赚点钱。”</p><p><br/>　　正是这种敢于尝试的基因，让天天果园培育出了一批愿意接触新事物的用户，国外的水果协会也更愿意将天天果园作为新品出口的首发渠道。反过来，这些直达当地生产源头的水果供应商，日渐成为天天果园的竞争壁垒。</p><p><br/>　　回顾创业这五年，赵国璋坦言互联网做生鲜其实很难，但却能实实在在地消除信息的不对称。“过去十几年，我们眼中的进口水果只有国别，没有产地和品种之分。互联网将以前非标准的水果商品变得标准化，大家对水果行业越来越熟悉，贴假标、以次充好的现象越来越少。”</p><p><br/>　　<strong>对水果的的热爱和专注，转化到生意上，就是对细节的苛求。</strong></p><p><br/>　　去年夏天，美国西北樱桃协会邀请时任美国驻华大使骆家辉助力销售。为了迎接这次可预见的销量爆发，天天果园提前对樱桃的包装材料做了测试。</p><p><br/>　　市面上常见的泡沫保温箱多是用回收材料制成。考虑到这种保温箱会散发化学气体，不利于储存食品，天天果园选用了日本制造的原生泡沫箱，\r\n成本是前者的三倍。为了确认来自日本的保温箱无害，天天果园的员工在泡沫箱里养了两条鱼。“看到鱼一直活着，我们才敲定了用这个箱子。”</p><p><br/>　　同样，冷链最后一环节使用的冰袋，天天果园最终选择了储存药品的专用冰袋。</p><p><br/>　　在接受《创业家》采访中，赵国璋一直强调，希望消费者吃到嘴的都是口感最好的水果，这样的情怀在去年夏天的那场配送中发挥到了极致：有\r\n一批发到广州的樱桃，因为物流公司出了问题，发货时间比原定晚了一天。当时正值南方高温，天天果园做出一个惊人的决定：召回几百份樱桃，就地报废，然后再\r\n重新发一批最新鲜的。这一单，天天果园损失了近二十万元左右。“就是希望用户收到后有好的体验。”赵国璋说。</p><p><br/>　　“长远的生意才会做这些事情。我们不希望由于自己的疏忽，或是刻意降低成本的行为破坏用户体验。我们一直按照国际标准完善仓储和配送体系，需要提升的地方还有很多，目前就从力所能及的细节开始做起。” 赵国璋告诉记者。</p><p><br/></p>', 'derek', '', '', '0', '1', '1438053372', '', '0', 'http://', '', '1');
