  `goods_type` smallint(5) unsigned NOT NULL DEFAULT '0',
  `seller_note` varchar(255) NOT NULL DEFAULT '',
  `give_integral` int(11) NOT NULL DEFAULT '-1',
  `rank_integral` int(11) NOT NULL DEFAULT '-1',
  `suppliers_id` smallint(5) unsigned DEFAULT NULL,
  `supplier_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `supplier_status` tinyint(1) NOT NULL DEFAULT '0',
  `supplier_status_txt` text NOT NULL,
  `is_check` tinyint(1) unsigned DEFAULT NULL,
  `is_catindex` tinyint(1) unsigned NOT NULL,
  `cost_price` decimal(10,2) NOT NULL DEFAULT '0.00',
  `valid_date` int(11) DEFAULT NULL,
  `is_virtual` int(11) NOT NULL DEFAULT '0',
  `exclusive` varchar(255) NOT NULL DEFAULT '-1' COMMENT '手机专享价格',
  `goods_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0：后台添加的商品，1：diy商品未出售状态，2：diy商品申请出售审核中状态，3：审核不通过状态，4：diy商品已出售状态',
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `goods_design` varchar(255) DEFAULT NULL COMMENT '设计描述',
  `goods_tags` varchar(255) DEFAULT NULL COMMENT '商品标签',
  `goods_rank` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '商品等级（跟设计商品时用户的等级同步）',
  `commision1` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '第1阶段佣金',
  `commision2` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '第2阶段佣金',
  PRIMARY KEY (`goods_id`),
  KEY `goods_sn` (`goods_sn`),
  KEY `cat_id` (`cat_id`),
  KEY `last_update` (`last_update`),
  KEY `brand_id` (`brand_id`),
  KEY `goods_weight` (`goods_weight`),
  KEY `promote_end_date` (`promote_end_date`),
  KEY `promote_start_date` (`promote_start_date`),
  KEY `goods_number` (`goods_number`),
  KEY `sort_order` (`sort_order`),
  KEY `is_catindex` (`is_catindex`)
) ENGINE=MyISAM AUTO_INCREMENT=1137 DEFAULT CHARSET=utf8;

