  `add_time` int(11) NOT NULL COMMENT '添加时间',
  `end_time` int(11) NOT NULL DEFAULT '0' COMMENT '倒计时结束时间',
  `is_finish` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0未完成，1已完成，2拼团失败未退款，3拼团失败并退钱到余额，4拼团失败并原路退回到支付账户，5拼团失败自动原路退回支付账户失败',
  `finish_time` int(11) NOT NULL COMMENT '拼团完成时间',
  `order_id` int(10) NOT NULL DEFAULT '0' COMMENT '订单ID',
  `back_id` int(10) NOT NULL DEFAULT '0' COMMENT '退款单ID',
  `refund_id` varchar(255) NOT NULL DEFAULT '0' COMMENT '原路退款回调ID',
