  PRIMARY KEY (`l_id`),
  KEY `sender_id` (`mem_id`,`mess_id`) USING BTREE,
  KEY `receiver_id` (`mess_id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=683 DEFAULT CHARSET=utf8;

