  `alias` varchar(60) NOT NULL,
  `msn` varchar(60) NOT NULL,
  `qq` varchar(20) NOT NULL,
  `qq_open` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '0不公开QQ，1公开QQ',
  `office_phone` varchar(20) NOT NULL,
  `home_phone` varchar(20) NOT NULL,
  `mobile_phone` varchar(20) NOT NULL,
  `is_validated` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '邮箱是否已验证',
  `validated` int(11) NOT NULL COMMENT '手机是否已验证',
  `credit_line` decimal(10,2) unsigned NOT NULL,
  `passwd_question` varchar(50) DEFAULT NULL,
  `passwd_answer` varchar(255) DEFAULT NULL,
  `is_fenxiao` tinyint(1) NOT NULL,
  `real_name` varchar(255) NOT NULL,
  `card` varchar(255) NOT NULL,
  `face_card` varchar(255) NOT NULL,
  `back_card` varchar(255) NOT NULL,
  `country` int(11) NOT NULL,
  `province` int(11) NOT NULL,
  `city` int(11) NOT NULL,
  `district` int(11) NOT NULL,
  `address` varchar(255) NOT NULL,
  `status` int(11) NOT NULL,
  `mediaUID` varchar(50) NOT NULL,
  `mediaID` int(4) NOT NULL,
  `froms` char(10) NOT NULL DEFAULT 'pc' COMMENT 'pc:电脑,mobile:手机,app:应用',
  `headimg` text NOT NULL,
  `weixin` varchar(60) NOT NULL COMMENT '微信',
  `wx_open` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '0不公开微信，1公开微信',
  `profile` text NOT NULL COMMENT '个性签名',
  `weibo` text NOT NULL COMMENT '微博地址',
  `facebook` text NOT NULL COMMENT 'facebook地址',
  `instagram` text NOT NULL COMMENT 'instagram地址',
  `website` text NOT NULL COMMENT '个人网站',
  `nickname` varchar(60) NOT NULL DEFAULT '' COMMENT '昵称',
  `fields` text NOT NULL COMMENT '领域',
  `sh_province` int(11) NOT NULL COMMENT '学校（省）',
  `sh_city` int(11) NOT NULL COMMENT '学校（市）',
  `sh_school` int(11) NOT NULL COMMENT '学校',
  `is_renzheng` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否已实名认证',
  `rank_sale_number` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '销量',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `user_name` (`user_name`),
  KEY `email` (`email`),
  KEY `parent_id` (`parent_id`),
  KEY `flag` (`flag`),
  KEY `mediaUID` (`mediaUID`,`mediaID`)
) ENGINE=MyISAM AUTO_INCREMENT=165 DEFAULT CHARSET=utf8;

